(3, 'About Us', 'http://taskpost.nsglobalsystem.com/how_it_work.php', '<p class=\\\"MsoNormal\\\">PortuGo is an online food service delivery platform which aims to simplify the process of ordering takeaway in Portugal. <o:p></o:p></p>\n<p class=\\\"MsoNormal\\\">Whilst Portugal has a thriving takeaway scene it can be difficult to navigate. Our vision is to be the one-stop hub for ordering food online. We believe that ordering takeaway should be easy and effortless, so we have created a practical user friendly platform. At the click of a button you can explore and compare what&rsquo;s on offer in your area.</p>\n<p class=\\\"MsoNormal\\\">PortuGo has recently launched in Lisbon. We endeavour to grow our presence in the capital and expand throughout Portugal in the near future!&nbsp;</p>\n<p class=\\\"MsoNormal\\\">&nbsp;</p>\n<p class=\\\"MsoNormal\\\"><span style=\\\"color: rgb(35, 33, 31); font-family: &quot;Segoe UI&quot;; font-size: 24px;\\\">Why PortuGo?</span></p>\n<p class=\\\"MsoNormal\\\">&nbsp;</p>\n<table style=\\\"box-sizing: border-box; outline: none; border-width: initial; border-style: none; border-color: initial; margin: 0px 0px 40px; padding: 0px; max-width: 100%; color: rgb(7, 7, 7); font-family: &quot;Segoe UI&quot;, Arial, sans-serif; font-size: 14px;\\\" width=\\\"100%\\\" cellspacing=\\\"0\\\" cellpadding=\\\"0\\\" border=\\\"0\\\">\n    <tbody style=\\\"box-sizing: border-box; outline: none; border: none; margin: 0px; padding: 0px;\\\">\n        <tr style=\\\"box-sizing: border-box; outline: none; border: none; margin: 0px; padding: 0px;\\\">\n            <td rowspan=\\\"2\\\" style=\\\"box-sizing: border-box; outline: none; border-width: initial; border-style: none; border-color: initial; margin: 0px; padding: 0px;\\\" width=\\\"11%\\\" valign=\\\"top\\\" align=\\\"center\\\"><img src=\\\"http://portugo.pt/public/front/images/abou_img1.png\\\" style=\\\"box-sizing: border-box; outline: none; border: 0px none; margin: 0px 40px 0px 0px; padding: 0px; vertical-align: middle;\\\" alt=\\\"\\\" /></td>\n            <td style=\\\"box-sizing: border-box; outline: none; border-width: initial; border-style: none; border-color: initial; margin: 0px; padding: 0px;\\\" width=\\\"89%\\\" valign=\\\"top\\\">\n            <h3 style=\\\"box-sizing: border-box; outline: none; border: none; margin: 0px; padding: 0px; color: rgb(35, 33, 31); line-height: 1.1; font-size: 20px; font-family: &quot;Segoe UI&quot;;\\\">Always Available</h3>\n            </td>\n        </tr>\n        <tr style=\\\"box-sizing: border-box; outline: none; border: none; margin: 0px; padding: 0px;\\\">\n            <td style=\\\"box-sizing: border-box; outline: none; border-width: initial; border-style: none; border-color: initial; margin: 0px; padding: 0px;\\\" valign=\\\"top\\\">\n            <p style=\\\"box-sizing: border-box; outline: none; border: none; margin: 0px; padding: 10px 0px; color: rgb(35, 33, 31); font-size: 14px; font-family: &quot;Segoe UI&quot;; line-height: 25px;\\\">We want to make life as easy as possible for our participating restaurants and users. We are available around the clock to offer guidance &amp; support.</p>\n            </td>\n        </tr>\n    </tbody>\n</table>\n<table style=\\\"box-sizing: border-box; outline: none; border-width: initial; border-style: none; border-color: initial; margin: 0px 0px 40px; padding: 0px; max-width: 100%; color: rgb(7, 7, 7); font-family: &quot;Segoe UI&quot;, Arial, sans-serif; font-size: 14px;\\\" width=\\\"100%\\\" cellspacing=\\\"0\\\" cellpadding=\\\"0\\\" border=\\\"0\\\">\n    <tbody style=\\\"box-sizing: border-box; outline: none; border: none; margin: 0px; padding: 0px;\\\">\n        <tr style=\\\"box-sizing: border-box; outline: none; border: none; margin: 0px; padding: 0px;\\\">\n            <td rowspan=\\\"2\\\" style=\\\"box-sizing: border-box; outline: none; border-width: initial; border-style: none; border-color: initial; margin: 0px; padding: 0px;\\\" width=\\\"11%\\\" valign=\\\"top\\\" align=\\\"center\\\"><img src=\\\"http://portugo.pt/public/front/images/abou_img2.png\\\" style=\\\"box-sizing: border-box; outline: none; border: 0px none; margin: 0px 40px 0px 0px; padding: 0px; vertical-align: middle;\\\" alt=\\\"\\\" /></td>\n            <td style=\\\"box-sizing: border-box; outline: none; border-width: initial; border-style: none; border-color: initial; margin: 0px; padding: 0px;\\\" width=\\\"89%\\\" valign=\\\"top\\\">\n            <h3 style=\\\"box-sizing: border-box; outline: none; border: none; margin: 0px; padding: 0px; color: rgb(35, 33, 31); line-height: 1.1; font-size: 20px; font-family: &quot;Segoe UI&quot;;\\\">Qualified Staff</h3>\n            </td>\n        </tr>\n        <tr style=\\\"box-sizing: border-box; outline: none; border: none; margin: 0px; padding: 0px;\\\">\n            <td style=\\\"box-sizing: border-box; outline: none; border-width: initial; border-style: none; border-color: initial; margin: 0px; padding: 0px;\\\" valign=\\\"top\\\">\n            <p style=\\\"box-sizing: border-box; outline: none; border: none; margin: 0px; padding: 10px 0px; color: rgb(35, 33, 31); font-size: 14px; font-family: &quot;Segoe UI&quot;; line-height: 25px;\\\">We have a dedicated team who are passionate about what they do! Young, dynamic and driven to succeed, we are the drivers of change.</p>\n            </td>\n        </tr>\n    </tbody>\n</table>\n<table style=\\\"box-sizing: border-box; outline: none; border-width: initial; border-style: none; border-color: initial; margin: 0px 0px 40px; padding: 0px; max-width: 100%; color: rgb(7, 7, 7); font-family: &quot;Segoe UI&quot;, Arial, sans-serif; font-size: 14px;\\\" width=\\\"100%\\\" cellspacing=\\\"0\\\" cellpadding=\\\"0\\\" border=\\\"0\\\">\n    <tbody style=\\\"box-sizing: border-box; outline: none; border: none; margin: 0px; padding: 0px;\\\">\n        <tr style=\\\"box-sizing: border-box; outline: none; border: none; margin: 0px; padding: 0px;\\\">\n            <td rowspan=\\\"2\\\" style=\\\"box-sizing: border-box; outline: none; border-width: initial; border-style: none; border-color: initial; margin: 0px; padding: 0px;\\\" width=\\\"11%\\\" valign=\\\"top\\\" align=\\\"center\\\"><img src=\\\"http://portugo.pt/public/front/images/abou_img3.png\\\" style=\\\"box-sizing: border-box; outline: none; border: 0px none; margin: 0px 40px 0px 0px; padding: 0px; vertical-align: middle;\\\" alt=\\\"\\\" /></td>\n            <td style=\\\"box-sizing: border-box; outline: none; border-width: initial; border-style: none; border-color: initial; margin: 0px; padding: 0px;\\\" width=\\\"89%\\\" valign=\\\"top\\\">\n            <h3 style=\\\"box-sizing: border-box; outline: none; border: none; margin: 0px; padding: 0px; color: rgb(35, 33, 31); line-height: 1.1; font-size: 20px; font-family: &quot;Segoe UI&quot;;\\\">Exceptional Service</h3>\n            </td>\n        </tr>\n        <tr style=\\\"box-sizing: border-box; outline: none; border: none; margin: 0px; padding: 0px;\\\">\n            <td style=\\\"box-sizing: border-box; outline: none; border-width: initial; border-style: none; border-color: initial; margin: 0px; padding: 0px;\\\" valign=\\\"top\\\">\n            <p style=\\\"box-sizing: border-box; outline: none; border: none; margin: 0px; padding: 10px 0px; color: rgb(35, 33, 31); font-size: 14px; font-family: &quot;Segoe UI&quot;; line-height: 25px;\\\">As a small organisation we have the ability to develop close relationships with our participating restaurants. We focus our efforts to understand and respond to their needs. We are very responsive and are always looking for ways to improve our service.</p>\n            </td>\n        </tr>\n    </tbody>\n</table>\n<div class=\\\"col-sm-12 padding_0\\\" style=\\\"box-sizing: border-box; outline: none; border: none; margin: 0px 0px 30px; padding: 0px 15px; min-height: 1px; position: relative; float: left; width: 1070px; color: rgb(7, 7, 7); font-family: &quot;Segoe UI&quot;, Arial, sans-serif; font-size: 14px;\\\">\n<div>&nbsp;</div>\n</div>\n<p>&nbsp;</p>', 'Sobre nós', '<div data-block=\\\"true\\\" data-editor=\\\"2b73o\\\" data-offset-key=\\\"9beuu-0-0\\\" style=\\\"color: rgb(29, 33, 41); font-family: Helvetica, Arial, sans-serif; white-space: pre-wrap;\\\">\n<div data-offset-key=\\\"9beuu-0-0\\\" class=\\\"_1mf _1mj\\\" style=\\\"position: relative; direction: ltr;\\\"><span style=\\\"font-size: larger;\\\"><span style=\\\"font-family: \\\'Times New Roman\\\';\\\"><span data-offset-key=\\\"9beuu-0-0\\\">PortuGo &eacute; uma plataforma online de encomendas de refei&ccedil;&otilde;es, que visa simplificar o processo de pedido de take-away em Portugal.</span></span></span></div>\n</div>\n<div data-block=\\\"true\\\" data-editor=\\\"2b73o\\\" data-offset-key=\\\"u3vm-0-0\\\" style=\\\"color: rgb(29, 33, 41); font-family: Helvetica, Arial, sans-serif; white-space: pre-wrap;\\\">\n<div data-offset-key=\\\"u3vm-0-0\\\" class=\\\"_1mf _1mj\\\" style=\\\"position: relative; direction: ltr;\\\"><span style=\\\"font-family: \\\'Times New Roman\\\'; font-size: larger;\\\">Enquanto Portugal tem um pr&oacute;spero mercado de takeaway, pode seri dif&iacute;cil encontrar a refei&ccedil;&atilde;o desejada. Nossa miss&atilde;o &eacute; ser um local &uacute;nico on-line para encomendar comida. Acreditamos que encomendar takeaway deve ser f&aacute;cil e sem esfor&ccedil;o e, por isso, criamos uma pr&aacute;tica plataforma pr&aacute;tica e amig&aacute;vel. Com o clique de um bot&atilde;o voc&ecirc; pode explorar e comparar o que est&aacute; em oferta em sua &aacute;rea.</span></div>\n</div>\n<div data-block=\\\"true\\\" data-editor=\\\"2b73o\\\" data-offset-key=\\\"e1n7f-0-0\\\" style=\\\"color: rgb(29, 33, 41); font-family: Helvetica, Arial, sans-serif; white-space: pre-wrap;\\\">&nbsp;</div>\n<div data-block=\\\"true\\\" data-editor=\\\"2b73o\\\" data-offset-key=\\\"4r94s-0-0\\\" style=\\\"color: rgb(29, 33, 41); font-family: Helvetica, Arial, sans-serif; white-space: pre-wrap;\\\">\n<div data-offset-key=\\\"4r94s-0-0\\\" class=\\\"_1mf _1mj\\\" style=\\\"position: relative; direction: ltr;\\\"><span style=\\\"font-family: \\\'Times New Roman\\\'; font-size: larger;\\\">PortuGo foi lan&ccedil;ado recentemente em Lisboa. Nos esfor&ccedil;amos para crescer nossa presen&ccedil;a na capital e expandir em todo Portugal em um futuro pr&oacute;ximo!</span></div>\n</div>\n<div data-block=\\\"true\\\" data-editor=\\\"2b73o\\\" data-offset-key=\\\"5qgid-0-0\\\" style=\\\"color: rgb(29, 33, 41); font-family: Helvetica, Arial, sans-serif; white-space: pre-wrap;\\\">&nbsp;</div>\n<p style=\\\"box-sizing: border-box; outline: none; border: none; margin: 0px; padding: 10px 0px; color: rgb(35, 33, 31); font-size: 14px; font-family: \\\'Segoe UI\\\'; line-height: 25px;\\\">&nbsp;</p>\n<p style=\\\"box-sizing: border-box; outline: none; border: none; margin: 0px; padding: 10px 0px; color: rgb(35, 33, 31); font-size: 14px; font-family: \\\'Segoe UI\\\'; line-height: 25px;\\\">&nbsp;</p>\n<p style=\\\"box-sizing: border-box; outline: none; border: none; margin: 0px; padding: 10px 0px; color: rgb(35, 33, 31); font-size: 14px; font-family: \\\'Segoe UI\\\'; line-height: 25px;\\\"><span style=\\\"font-size: 24px;\\\">Por que somos sua melhor op&ccedil;&atilde;o?</span></p>\n<table style=\\\"border-width: initial; border-style: none; border-color: initial; box-sizing: border-box; outline: none; margin: 0px 0px 40px; padding: 0px; max-width: 100%; color: rgb(7, 7, 7); font-family: &quot;Segoe UI&quot;, Arial, sans-serif; font-size: 14px;\\\" width=\\\"100%\\\" cellspacing=\\\"0\\\" cellpadding=\\\"0\\\" border=\\\"0\\\">\n    <tbody style=\\\"box-sizing: border-box; outline: none; border: none; margin: 0px; padding: 0px;\\\">\n        <tr style=\\\"box-sizing: border-box; outline: none; border: none; margin: 0px; padding: 0px;\\\">\n            <td rowspan=\\\"2\\\" style=\\\"border-width: initial; border-style: none; border-color: initial; box-sizing: border-box; outline: none; margin: 0px; padding: 0px;\\\" width=\\\"11%\\\" valign=\\\"top\\\" align=\\\"center\\\"><img src=\\\"http://portugo.pt/public/front/images/abou_img1.png\\\" style=\\\"box-sizing: border-box; outline: none; border: 0px none; margin: 0px 40px 0px 0px; padding: 0px; vertical-align: middle;\\\" alt=\\\"\\\" /></td>\n            <td style=\\\"border-width: initial; border-style: none; border-color: initial; box-sizing: border-box; outline: none; margin: 0px; padding: 0px;\\\" width=\\\"89%\\\" valign=\\\"top\\\">\n            <h3 style=\\\"box-sizing: border-box; outline: none; border: none; margin: 0px; padding: 0px; color: rgb(35, 33, 31); line-height: 1.1; font-size: 20px; font-family: &quot;Segoe UI&quot;;\\\">&nbsp;</h3>\n            <h3><span lang=\\\"pt\\\">Sempre dispon&iacute;vel</span></h3>\n            </td>\n        </tr>\n        <tr style=\\\"box-sizing: border-box; outline: none; border: none; margin: 0px; padding: 0px;\\\">\n            <td style=\\\"border-width: initial; border-style: none; border-color: initial; box-sizing: border-box; outline: none; margin: 0px; padding: 0px;\\\" valign=\\\"top\\\">\n            <p style=\\\"box-sizing: border-box; outline: none; border: none; margin: 0px; padding: 10px 0px; color: rgb(35, 33, 31); font-size: 14px; font-family: &quot;Segoe UI&quot;; line-height: 25px;\\\">Queremos tornar a vida do nossos usuarios o mais f&aacute;cil poss&iacute;vel &nbsp;por isso n&oacute;s estamos dispon&iacute;veis 24 horas por dia para oferecer<br />\n            orienta&ccedil;&atilde;o e suporte.</p>\n            </td>\n        </tr>\n    </tbody>\n</table>\n<table style=\\\"border-width: initial; border-style: none; border-color: initial; box-sizing: border-box; outline: none; margin: 0px 0px 40px; padding: 0px; max-width: 100%; color: rgb(7, 7, 7); font-family: &quot;Segoe UI&quot;, Arial, sans-serif; font-size: 14px;\\\" width=\\\"100%\\\" cellspacing=\\\"0\\\" cellpadding=\\\"0\\\" border=\\\"0\\\">\n    <tbody style=\\\"box-sizing: border-box; outline: none; border: none; margin: 0px; padding: 0px;\\\">\n        <tr style=\\\"box-sizing: border-box; outline: none; border: none; margin: 0px; padding: 0px;\\\">\n            <td rowspan=\\\"2\\\" style=\\\"border-width: initial; border-style: none; border-color: initial; box-sizing: border-box; outline: none; margin: 0px; padding: 0px;\\\" width=\\\"11%\\\" valign=\\\"top\\\" align=\\\"center\\\"><img src=\\\"http://portugo.pt/public/front/images/abou_img2.png\\\" style=\\\"box-sizing: border-box; outline: none; border: 0px none; margin: 0px 40px 0px 0px; padding: 0px; vertical-align: middle;\\\" alt=\\\"\\\" /></td>\n            <td style=\\\"border-width: initial; border-style: none; border-color: initial; box-sizing: border-box; outline: none; margin: 0px; padding: 0px;\\\" width=\\\"89%\\\" valign=\\\"top\\\">\n            <h3 style=\\\"box-sizing: border-box; outline: none; border: none; margin: 0px; padding: 0px; color: rgb(35, 33, 31); line-height: 1.1; font-size: 20px; font-family: &quot;Segoe UI&quot;;\\\">&nbsp;</h3>\n            <h3><span lang=\\\"pt\\\">Pessoal Qualificado</span></h3>\n            </td>\n        </tr>\n        <tr style=\\\"box-sizing: border-box; outline: none; border: none; margin: 0px; padding: 0px;\\\">\n            <td style=\\\"border-width: initial; border-style: none; border-color: initial; box-sizing: border-box; outline: none; margin: 0px; padding: 0px;\\\" valign=\\\"top\\\">\n            <p style=\\\"box-sizing: border-box; outline: none; border: none; margin: 0px; padding: 10px 0px; color: rgb(35, 33, 31); font-size: 14px; font-family: &quot;Segoe UI&quot;; line-height: 25px;\\\">Temos uma equipe dedicada que s&atilde;o apaixonados pelo que fazem! Jovem, din&acirc;mico e motivado para ter sucesso.&nbsp;<br />\n            &nbsp;</p>\n            </td>\n        </tr>\n    </tbody>\n</table>\n<table style=\\\"border-width: initial; border-style: none; border-color: initial; box-sizing: border-box; outline: none; margin: 0px 0px 40px; padding: 0px; max-width: 100%; color: rgb(7, 7, 7); font-family: &quot;Segoe UI&quot;, Arial, sans-serif; font-size: 14px;\\\" width=\\\"100%\\\" cellspacing=\\\"0\\\" cellpadding=\\\"0\\\" border=\\\"0\\\">\n    <tbody style=\\\"box-sizing: border-box; outline: none; border: none; margin: 0px; padding: 0px;\\\">\n        <tr style=\\\"box-sizing: border-box; outline: none; border: none; margin: 0px; padding: 0px;\\\">\n            <td rowspan=\\\"2\\\" style=\\\"border-width: initial; border-style: none; border-color: initial; box-sizing: border-box; outline: none; margin: 0px; padding: 0px;\\\" width=\\\"11%\\\" valign=\\\"top\\\" align=\\\"center\\\"><img src=\\\"http://portugo.pt/public/front/images/abou_img3.png\\\" style=\\\"box-sizing: border-box; outline: none; border: 0px none; margin: 0px 40px 0px 0px; padding: 0px; vertical-align: middle;\\\" alt=\\\"\\\" /></td>\n            <td style=\\\"border-width: initial; border-style: none; border-color: initial; box-sizing: border-box; outline: none; margin: 0px; padding: 0px;\\\" width=\\\"89%\\\" valign=\\\"top\\\">\n            <h3 style=\\\"box-sizing: border-box; outline: none; border: none; margin: 0px; padding: 0px; color: rgb(35, 33, 31); line-height: 1.1; font-size: 20px; font-family: &quot;Segoe UI&quot;;\\\">Melhor Servico</h3>\n            </td>\n        </tr>\n        <tr style=\\\"box-sizing: border-box; outline: none; border: none; margin: 0px; padding: 0px;\\\">\n            <td style=\\\"border-width: initial; border-style: none; border-color: initial; box-sizing: border-box; outline: none; margin: 0px; padding: 0px;\\\" valign=\\\"top\\\">\n            <p style=\\\"box-sizing: border-box; outline: none; border: none; margin: 0px; padding: 10px 0px; color: rgb(35, 33, 31); font-size: 14px; font-family: &quot;Segoe UI&quot;; line-height: 25px;\\\">Como uma pequena organiza&ccedil;&atilde;o, temos a capacidade de desenvolver rela&ccedil;&otilde;es estreitas com os nossos restaurantes participantes. Concentramos nossos esfor&ccedil;os em entender e responder &agrave;s suas necessidades. N&oacute;s estamos sempre procurando maneiras de melhorar o&nbsp;nosso servi&ccedil;o.</p>\n            <div><span style=\\\"color: rgb(33, 33, 33); font-size: small; white-space: pre-wrap;\\\"><br />\n            </span></div>\n            </td>\n        </tr>\n    </tbody>\n</table>\n<p>&nbsp;</p>', '2015-05-27 06:10:53', '1');
INSERT INTO `cms` (`cms_id`, `page_title`, `page_url`, `page_content`, `portugoese_tittle`, `portugoese_content`, `create_date_time`, `status`) VALUES
(16, 'Privacy Policy', '', '<p><span style=\\\"font-size: larger;\\\"><span style=\\\"font-family: Verdana;\\\">Portugo.pt complies with the rules and regulations set out in the Personal Data Protection Act (WBP).&nbsp;All information collected through this website will be saved and used only in the course of fulfilling our responsibilities under our&nbsp;<b>Terms and Conditions&nbsp;</b>and any contracts entered with You, as well as for administration and accounting purposes.</span></span></p>\n<p><span style=\\\"font-family: Verdana;\\\"> </span></p>\n<h1><span style=\\\"font-size: x-large;\\\"><strong>Data we store and why we need it</strong></span></h1>\n<p><span style=\\\"font-size: larger;\\\"><span style=\\\"font-family: Verdana;\\\">Portugo.pt collects various pieces of personal information when you use our website including but not limited to:</span></span></p>\n<ul>\n    <li><span style=\\\"font-size: larger;\\\"><span style=\\\"font-family: Verdana;\\\">To register</span></span></li>\n    <li><span style=\\\"font-size: larger;\\\"><span style=\\\"font-family: Verdana;\\\">To login</span></span></li>\n    <li><span style=\\\"font-size: larger;\\\"><span style=\\\"font-family: Verdana;\\\">To place an order</span></span></li>\n    <li><span style=\\\"font-size: larger;\\\"><span style=\\\"font-family: Verdana;\\\">To pay online</span></span></li>\n    <li><span style=\\\"font-size: larger;\\\"><span style=\\\"font-family: Verdana;\\\">To recommend a restaurant</span></span></li>\n</ul>\n<p><span style=\\\"font-size: larger;\\\"><span style=\\\"font-family: Verdana;\\\">The following is an exhaustive list of the type of information you may have provided us with:</span></span></p>\n<ul>\n    <li><span style=\\\"font-size: larger;\\\"><span style=\\\"font-family: Verdana;\\\">First and last name</span></span></li>\n    <li><span style=\\\"font-size: larger;\\\"><span style=\\\"font-family: Verdana;\\\">Your password</span></span></li>\n    <li><span style=\\\"font-size: larger;\\\"><span style=\\\"font-family: Verdana;\\\">Date of birth&nbsp;we may need to have this as storing data of under-aged people will be heavily legislated, probably prohibited)</span></span></li>\n    <li><span style=\\\"font-size: larger;\\\"><span style=\\\"font-family: Verdana;\\\">Home address</span></span></li>\n    <li><span style=\\\"font-size: larger;\\\"><span style=\\\"font-family: Verdana;\\\"><span style=\\\"color: rgb(41, 41, 41);\\\"><span style=\\\"font-variant-numeric: normal; font-stretch: normal; line-height: normal;\\\">&nbsp;</span></span>Location</span></span></li>\n    <li><span style=\\\"font-size: larger;\\\"><span style=\\\"font-family: Verdana;\\\">IP address</span></span></li>\n    <li><span style=\\\"font-size: larger;\\\"><span style=\\\"font-family: Verdana;\\\">Internet browser and device type</span></span></li>\n    <li><span style=\\\"font-size: larger;\\\"><span style=\\\"font-family: Verdana;\\\"><span style=\\\"color: rgb(41, 41, 41);\\\"><span style=\\\"font-variant-numeric: normal; font-stretch: normal; line-height: normal;\\\">&nbsp;</span></span>Phone number</span></span></li>\n    <li><span style=\\\"font-size: larger;\\\"><span style=\\\"font-family: Verdana;\\\">Email address</span></span></li>\n    <li><span style=\\\"font-size: larger;\\\"><span style=\\\"font-family: Verdana;\\\">Any other personal information you may need to provide actively by using the website (e.g. in the comments box when finalising your order)</span></span></li>\n    <li><span style=\\\"font-size: larger;\\\"><span style=\\\"font-family: Verdana;\\\">Information about your activity on Portugo.pt (Please see our&nbsp;<b>Cookies Policy)</b></span></span></li>\n</ul>\n<p><span style=\\\"font-size: larger;\\\"><span style=\\\"font-family: Verdana;\\\">We do not wish to gather or store personal data of any kind of website visitors younger than 16 years of age unless authorised by a parent or the responsible guardian. While we encourage parents to be involved in their children&rsquo;s online presence, we have no way to verify a user is indeed older than 16.</span></span></p>\n<p><span style=\\\"font-size: larger;\\\"><span style=\\\"font-family: Verdana;\\\"><span style=\\\"line-height: 14.2667px;\\\">If you are a parent or a guardian of a child under the age of 16 and discover they are registered with us, please contact us at&nbsp;</span></span></span><span style=\\\"font-family: Verdana;\\\"><b><span style=\\\"line-height: 14.2667px;\\\"><a href=\\\"mailto:contato@portugo.pt\\\"><span style=\\\"font-size: larger;\\\">contato@portugo.pt</span></a></span></b></span><span style=\\\"font-size: larger;\\\"><span style=\\\"font-family: Verdana;\\\"><b><span style=\\\"line-height: 14.2667px;\\\">&nbsp;</span></b><span style=\\\"line-height: 14.2667px;\\\">and we will immediately delete all related personal information stored with us.</span></span> </span></p>\n<h1><span style=\\\"font-family: Verdana;\\\"> </span><span style=\\\"font-size: x-large;\\\"><b>Payment Methods and Related Data Storage</b></span></h1>\n<p><span style=\\\"font-size: larger;\\\"><span style=\\\"font-family: Verdana;\\\">Because we want the best possible protection to your payment credentials, we only work with PayPal. They are the largest and most trusted online payment mediator.</span></span></p>\n<p><span style=\\\"font-size: larger;\\\"><span style=\\\"font-family: Verdana;\\\">Any payment information you may need to enter to complete and order at Portugo.pt will be processed by PayPal and therefore stored by them.</span></span>&nbsp;</p>\n<p><span style=\\\"font-family: Verdana;\\\"> </span></p>\n<h1><span style=\\\"font-size: x-large;\\\"><b>How We Use Your Information</b></span></h1>\n<p><span style=\\\"font-size: larger;\\\"><span style=\\\"font-family: Verdana;\\\">We use information you actively provide to us in the following cases:</span></span></p>\n<ul>\n    <li><span style=\\\"font-size: larger;\\\"><span style=\\\"font-family: Verdana;\\\">To provide restaurants with your address and phone number (where applicable) in order for them to deliver your order.</span></span></li>\n    <li><span style=\\\"font-size: larger;\\\"><span style=\\\"font-family: Verdana;\\\">To reimburse you in the event of your order being declined/not delivered.</span></span></li>\n</ul>\n<p><span style=\\\"font-size: larger;\\\"><span style=\\\"font-family: Verdana;\\\"> </span></span></p>\n<p><span style=\\\"font-size: larger;\\\"><span style=\\\"font-family: Verdana;\\\">Portugo.pt also monitors your activities on the website. This information is used to improve your experience by offering you products and services tailored to your preferences. (Please see our&nbsp;<b>Cookies Policy)</b></span></span></p>\n<p><span style=\\\"font-size: larger;\\\"><span style=\\\"font-family: Verdana;\\\">Another way you provide us with information is when you contact the customer service desk. We will use the collected data to answer your questions or to resolve your complaint. We might use your case, completely anonymously, as an example for a FAQ section.&nbsp;</span></span></p>\n<p><span style=\\\"font-family: Verdana;\\\"> </span></p>\n<h1><span style=\\\"font-size: x-large;\\\"><b>Verifying and Amending your Personal Information</b></span>&nbsp;</h1>\n<p><span style=\\\"font-size: larger;\\\"><span style=\\\"font-family: Verdana;\\\">Under the Personal Data Protection Act, you have the right to verify and at any given time amend all personal information we store related to your profile.&nbsp;Some articles you can change yourself in the&nbsp;<b>My Account section&nbsp;</b>or in the&nbsp;<b>Address Book&nbsp;</b>section.&nbsp;<span style=\\\"color: rgb(41, 41, 41);\\\">Alternatively, you can contact us by e-mail&nbsp;at&nbsp;</span></span></span><span style=\\\"font-family: Verdana;\\\"><a href=\\\"mailto:contato@portugo.pt\\\"><span style=\\\"font-size: larger;\\\"><b>contato@portugo.pt</b></span></a></span><span style=\\\"font-size: larger;\\\"><span style=\\\"font-family: Verdana;\\\">&nbsp;to perform these procedures. We encourage you to implement all changes yourself using the aforementioned options if possible, as it will take longer for the customer service desk to process your query, should you choose to submit it by email.The website may contain links to external websites.&nbsp;Please familiarise yourself with the corresponding privacy statements when visiting such websites. Portugo.pt selects the sites carefully, however we cannot be held responsible for how these third parties treat your personal information.</span></span></p>\n<h1><span style=\\\"font-size: x-large;\\\">Information Storing Period</span><span style=\\\"font-family: Verdana;\\\"><b><br />\n</b></span></h1>\n<p><span style=\\\"font-size: larger;\\\"><span style=\\\"font-family: Verdana;\\\">We will not keep your Data for longer than the necessary to maintain a normal course of business and will not use it for any other purposes than the ones laid out in the sections above.</span></span></p>\n<p><span style=\\\"font-size: x-large;\\\"><span style=\\\"font-family: Verdana;\\\"> </span></span></p>\n<p><span style=\\\"font-size: x-large;\\\"><b>Third Parties Disclosure</b></span></p>\n<p><span style=\\\"font-size: larger;\\\"><span style=\\\"font-family: Verdana;\\\">We do not sell, publish or in any way disclose your data with third parties for commercial purposes. We will make an exception to this statement only in the case of a request for information by a government agency, for example, as part of a police investigation.&nbsp;</span></span>&nbsp;</p>\n<p><span style=\\\"font-family: Verdana;\\\"> </span></p>\n<h1><span style=\\\"font-size: x-large;\\\"><b>Website Security</b></span></h1>\n<div style=\\\"margin-bottom: 0.0001pt; line-height: normal;\\\"><span style=\\\"font-family: Verdana;\\\"><span style=\\\"font-size: larger;\\\">Portugo.pt is committed to the protection of your personal data and takes the necessary steps to prevent abuse, loss, unauthorized access, accidental disclosure and unauthorized alteration.&nbsp;If you feel that your data is not properly secured or if there is evidence of abuse, please contact our customer service desk immediately at&nbsp;</span></span><span style=\\\"font-size: larger;\\\"><span style=\\\"font-family: Verdana;\\\"><a href=\\\"mailto:contato@portugo.pt\\\"><b>contato@portugo.pt</b></a>.&nbsp;</span></span></div>\n<p>&nbsp;</p>', 'Declaração de Privacidade', '<p class=\\\"MsoNormal\\\" style=\\\"text-align: left;\\\"><span style=\\\"color: rgb(41, 41, 41); font-family: Verdana, sans-serif; font-size: 10pt;\\\">Portugo.pt cumpre com as regras e regulamentos estabelecidos na Lei de Protec&ccedil;&atilde;o de Dados Pessoais (WBP). Todas as informa&ccedil;&otilde;es coletadas atrav&eacute;s deste site ser&atilde;o salvas e usadas apenas no cumprimento de nossas responsabilidades sob nossos Termos e Condi&ccedil;&otilde;es e quaisquer contratos celebrados com voc&ecirc;, bem como para fins de administra&ccedil;&atilde;o e contabilidade.</span></p>\n<p class=\\\"MsoNormal\\\" style=\\\"margin-bottom: 0.0001pt; line-height: normal; text-align: left;\\\">&nbsp;<br />\n<span style=\\\"font-size: medium;\\\"><b><span lang=\\\"PT-BR\\\" style=\\\"font-family: Verdana, sans-serif;\\\">Dados que armazenamos e por que precisamos deles</span></b></span><span lang=\\\"PT-BR\\\" style=\\\"font-size:10.0pt;font-family:&#10;&quot;Verdana&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:&#10;Arial;color:#292929;mso-fareast-language:EN-GB\\\"><o:p></o:p></span><br />\n<span lang=\\\"PT-BR\\\" style=\\\"font-size:10.0pt;font-family:&quot;Verdana&quot;,&quot;sans-serif&quot;;&#10;mso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:Arial;&#10;color:#292929;mso-fareast-language:EN-GB\\\">Portugo.pt recolhe v&aacute;rias informa&ccedil;&otilde;es pessoais enquanto voc&ecirc; utiliza nosso website incluindo, mas n&atilde;o se limitando a: <o:p></o:p></span></p>\n<ul>\n    <li><span lang=\\\"PT-BR\\\" style=\\\"font-size:10.0pt;&#10;font-family:&quot;Verdana&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;&#10;mso-bidi-font-family:Arial;color:#292929;mso-fareast-language:EN-GB\\\">Para registrar<o:p></o:p></span></li>\n    <li><span lang=\\\"PT-BR\\\" style=\\\"font-size:10.0pt;&#10;font-family:&quot;Verdana&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;&#10;mso-bidi-font-family:Arial;color:#292929;mso-fareast-language:EN-GB\\\">Para fazer login<o:p></o:p></span></li>\n    <li><span lang=\\\"PT-BR\\\" style=\\\"font-size:10.0pt;&#10;font-family:&quot;Verdana&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;&#10;mso-bidi-font-family:Arial;color:#292929;mso-fareast-language:EN-GB\\\">Para fazer um pedido<o:p></o:p></span></li>\n    <li><span lang=\\\"PT-BR\\\" style=\\\"font-size:10.0pt;&#10;font-family:&quot;Verdana&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;&#10;mso-bidi-font-family:Arial;color:#292929;mso-fareast-language:EN-GB\\\">Para pagar online<o:p></o:p></span></li>\n    <li><span lang=\\\"PT-BR\\\" style=\\\"font-size:10.0pt;&#10;font-family:&quot;Verdana&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;&#10;mso-bidi-font-family:Arial;color:#292929;mso-fareast-language:EN-GB\\\">Para recomendar um restaurante<o:p></o:p></span></li>\n</ul>\n<p><span lang=\\\"PT-BR\\\" style=\\\"font-size:10.0pt;font-family:&quot;Verdana&quot;,&quot;sans-serif&quot;;&#10;mso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:Arial;&#10;color:#292929;mso-fareast-language:EN-GB\\\">&nbsp;</span><span lang=\\\"PT-BR\\\" style=\\\"font-size:10.0pt;font-family:&quot;Verdana&quot;,&quot;sans-serif&quot;;&#10;mso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:Arial;&#10;color:#292929;mso-fareast-language:EN-GB\\\">Segue uma lista exaustiva do tipo de informa&ccedil;&otilde;es que voc&ecirc; pode nos ter fornecido:<o:p></o:p></span></p>\n<ul>\n    <li><span lang=\\\"PT-BR\\\" style=\\\"font-size:10.0pt;font-family:Symbol;mso-fareast-font-family:&#10;Symbol;mso-bidi-font-family:Symbol;color:#292929;mso-fareast-language:EN-GB\\\"><span style=\\\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\\\">&nbsp;</span></span><!--[endif]--><span lang=\\\"PT-BR\\\" style=\\\"font-size:10.0pt;&#10;font-family:&quot;Verdana&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;&#10;mso-bidi-font-family:Arial;color:#292929;mso-fareast-language:EN-GB\\\">Nome e apelido<o:p></o:p></span></li>\n    <li><span lang=\\\"PT-BR\\\" style=\\\"font-size:10.0pt;&#10;font-family:&quot;Verdana&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;&#10;mso-bidi-font-family:Arial;color:#292929;mso-fareast-language:EN-GB\\\">Sua senha<o:p></o:p></span></li>\n    <li><span lang=\\\"PT-BR\\\" style=\\\"font-size:10.0pt;&#10;font-family:&quot;Verdana&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;&#10;mso-bidi-font-family:Arial;color:#292929;mso-fareast-language:EN-GB\\\">Data de nascimento</span></li>\n    <li><span lang=\\\"PT-BR\\\" style=\\\"font-size:10.0pt;&#10;font-family:&quot;Verdana&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;&#10;mso-bidi-font-family:Arial;color:#292929;mso-fareast-language:EN-GB\\\">Morada residencial<o:p></o:p></span></li>\n    <li><span lang=\\\"PT-BR\\\" style=\\\"font-size:10.0pt;&#10;font-family:&quot;Verdana&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;&#10;mso-bidi-font-family:Arial;color:#292929;mso-fareast-language:EN-GB\\\">Localiza&ccedil;&atilde;o<o:p></o:p></span></li>\n    <li><span lang=\\\"PT-BR\\\" style=\\\"font-size:10.0pt;&#10;font-family:&quot;Verdana&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;&#10;mso-bidi-font-family:Arial;color:#292929;mso-fareast-language:EN-GB\\\">Endere&ccedil;o de IP <o:p></o:p></span></li>\n    <li><span lang=\\\"PT-BR\\\" style=\\\"font-size:10.0pt;&#10;font-family:&quot;Verdana&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;&#10;mso-bidi-font-family:Arial;color:#292929;mso-fareast-language:EN-GB\\\">Navegador de Internet e tipo de dispositivo<o:p></o:p></span></li>\n    <li><span lang=\\\"PT-BR\\\" style=\\\"font-size:10.0pt;&#10;font-family:&quot;Verdana&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;&#10;mso-bidi-font-family:Arial;color:#292929;mso-fareast-language:EN-GB\\\">N&uacute;mero de telefone<o:p></o:p></span></li>\n    <li><span lang=\\\"PT-BR\\\" style=\\\"font-size:10.0pt;&#10;font-family:&quot;Verdana&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;&#10;mso-bidi-font-family:Arial;color:#292929;mso-fareast-language:EN-GB\\\">Endere&ccedil;o de Email<o:p></o:p></span></li>\n    <li><span lang=\\\"PT-BR\\\" style=\\\"font-size:10.0pt;&#10;font-family:&quot;Verdana&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;&#10;mso-bidi-font-family:Arial;color:#292929;mso-fareast-language:EN-GB\\\">Quaisquer outras informa&ccedil;&otilde;es pessoais que voc&ecirc; necessite fornecer ativamente enquanto utiliza o website (Por exemplo: Na caixa de coment&aacute;rios ao finalizar seu pedido)<o:p></o:p></span></li>\n    <li><span lang=\\\"PT-BR\\\" style=\\\"font-size:10.0pt;&#10;font-family:&quot;Verdana&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;&#10;mso-bidi-font-family:Arial;color:#292929;mso-fareast-language:EN-GB\\\">Informa&ccedil;&otilde;es sobre sua atividade em Portugo.pt (Por favor consulte nossa </span><b><span lang=\\\"PT-BR\\\" style=\\\"font-size:10.0pt;&#10;font-family:&quot;Verdana&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;&#10;mso-bidi-font-family:Arial;color:red;mso-fareast-language:EN-GB\\\">Pol&iacute;tica de Cookies)</span></b><span lang=\\\"PT-BR\\\" style=\\\"font-size:10.0pt;font-family:&quot;Verdana&quot;,&quot;sans-serif&quot;;&#10;mso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:Arial;&#10;color:#292929;mso-fareast-language:EN-GB\\\"><o:p></o:p></span></li>\n</ul>\n<p class=\\\"MsoNormal\\\" style=\\\"margin-bottom:0in;margin-bottom:.0001pt;line-height:&#10;normal\\\"><span lang=\\\"PT-BR\\\" style=\\\"font-size:10.0pt;font-family:&quot;Verdana&quot;,&quot;sans-serif&quot;;&#10;mso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:Arial;&#10;color:#292929;mso-fareast-language:EN-GB\\\">N&oacute;s n&atilde;o desejamos coletar ou armazenar dados pessoais de qualquer tipo de visitantes do site com menos de 16 anos de idade, a menos que autorizado por um dos pais ou o tutor respons&aacute;vel. Enquanto incentivamos os pais a se envolverem na presen&ccedil;a online de seus filhos, n&atilde;o temos como verificar se um usu&aacute;rio tem mais de 16 anos.<o:p></o:p></span><span lang=\\\"PT-BR\\\" style=\\\"font-size:10.0pt;line-height:107%;&#10;font-family:&quot;Verdana&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;&#10;mso-bidi-font-family:Arial;color:#292929;mso-fareast-language:EN-GB\\\">&nbsp;</span></p>\n<p class=\\\"MsoNormal\\\"><span lang=\\\"PT-BR\\\" style=\\\"font-size:10.0pt;line-height:107%;&#10;font-family:&quot;Verdana&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;&#10;mso-bidi-font-family:Arial;color:#292929;mso-fareast-language:EN-GB\\\">Se for pai ou guardi&atilde;o de uma crian&ccedil;a com menos de 16 anos e descobrir que a mesma se encontra registrada connosco, por favor contacte-nos atrav&eacute;s do endere&ccedil;o </span><span lang=\\\"PT-BR\\\"><a href=\\\"mailto:contato@portugo.pt\\\"><b><span style=\\\"font-size:10.0pt;line-height:107%;font-family:&quot;Verdana&quot;,&quot;sans-serif&quot;;&#10;mso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:Arial;&#10;mso-fareast-language:EN-GB\\\">contato@portugo.pt</span></b></a></span><span lang=\\\"PT-BR\\\" style=\\\"font-size:10.0pt;line-height:107%;font-family:&quot;Verdana&quot;,&quot;sans-serif&quot;;&#10;mso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:Arial;&#10;color:red;mso-fareast-language:EN-GB\\\"> </span><span lang=\\\"PT-BR\\\" style=\\\"font-size:10.0pt;line-height:107%;font-family:&quot;Verdana&quot;,&quot;sans-serif&quot;;&#10;mso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:Arial;&#10;color:#292929;mso-fareast-language:EN-GB\\\">e suprimiremos de imediato todas as informa&ccedil;&otilde;es pessoais guardadas connosco.<o:p></o:p></span><br />\n<span lang=\\\"PT-BR\\\" style=\\\"font-size: 10pt; line-height: 107%; font-family: Verdana, sans-serif;\\\">&nbsp;</span></p>\n<p class=\\\"MsoNormal\\\" style=\\\"margin-bottom:0in;margin-bottom:.0001pt;line-height:&#10;normal\\\"><span style=\\\"font-size: medium;\\\"><b><span lang=\\\"PT-BR\\\" style=\\\"font-family: Verdana, sans-serif;\\\">M&eacute;todos de pagamento e armazenamento de dados relacionados</span></b></span><b><span lang=\\\"PT-BR\\\" style=\\\"font-family:&quot;Verdana&quot;,&quot;sans-serif&quot;\\\"><o:p></o:p></span></b><span style=\\\"font-size: medium;\\\"><br />\n</span></p>\n<p class=\\\"MsoNormal\\\" style=\\\"margin-bottom:0in;margin-bottom:.0001pt;line-height:&#10;normal\\\"><span lang=\\\"PT-BR\\\" style=\\\"font-size: 10pt; font-family: Verdana, sans-serif;\\\">Como queremos a melhor prote&ccedil;&atilde;o poss&iacute;vel para suas credenciais de pagamento, trabalhamos apenas com o PayPal. Eles s&atilde;o o maior e mais confi&aacute;vel mediador de pagamento on-line.<o:p></o:p></span></p>\n<p class=\\\"MsoNormal\\\" style=\\\"margin-bottom:0in;margin-bottom:.0001pt;line-height:&#10;normal\\\"><span lang=\\\"PT-BR\\\" style=\\\"font-size: 10pt; font-family: Verdana, sans-serif;\\\">Quaisquer informa&ccedil;&otilde;es de pagamento que voc&ecirc; precise entrar para concluir e encomendar em Portugo.pt ser&atilde;o processadas pelo PayPal e, portanto, armazenadas por eles.<br />\n<br />\n<o:p></o:p></span></p>\n<p class=\\\"MsoNormal\\\" style=\\\"margin-bottom:0in;margin-bottom:.0001pt;line-height:&#10;normal\\\"><span style=\\\"font-size: medium;\\\"><b><span lang=\\\"PT-BR\\\" style=\\\"font-family: Verdana, sans-serif;\\\">Como usamos suas informa&ccedil;&otilde;es</span></b></span><span lang=\\\"PT-BR\\\" style=\\\"font-size: 10pt; font-family: Verdana, sans-serif;\\\"><o:p></o:p></span></p>\n<p class=\\\"MsoNormal\\\" style=\\\"margin-bottom:0in;margin-bottom:.0001pt;line-height:&#10;normal;mso-outline-level:2\\\"><span lang=\\\"PT-BR\\\" style=\\\"font-size:10.0pt;&#10;font-family:&quot;Verdana&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;&#10;mso-bidi-font-family:Arial;color:#292929;mso-fareast-language:EN-GB;mso-bidi-font-weight:&#10;bold\\\">Utilizamos as informa&ccedil;&otilde;es que voc&ecirc; nos fornece ativamente nos seguintes casos:<o:p></o:p></span></p>\n<ul>\n    <li><span lang=\\\"PT-BR\\\" style=\\\"font-size:10.0pt;font-family:Symbol;mso-fareast-font-family:Symbol;&#10;mso-bidi-font-family:Symbol;color:#292929;mso-fareast-language:EN-GB;&#10;mso-bidi-font-weight:bold\\\"><span style=\\\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\\\">&nbsp;</span></span><!--[endif]--><span lang=\\\"PT-BR\\\" style=\\\"font-size:10.0pt;&#10;font-family:&quot;Verdana&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;&#10;mso-bidi-font-family:Arial;color:#292929;mso-fareast-language:EN-GB;mso-bidi-font-weight:&#10;bold\\\">Para fornecer aos restaurantes o seu endere&ccedil;o e n&uacute;mero de telefone (quando aplic&aacute;vel) para que eles possam entregar a sua encomenda.<o:p></o:p></span></li>\n    <li><span lang=\\\"PT-BR\\\" style=\\\"font-size:10.0pt;font-family:Symbol;mso-fareast-font-family:Symbol;&#10;mso-bidi-font-family:Symbol;color:#292929;mso-fareast-language:EN-GB;&#10;mso-bidi-font-weight:bold\\\"><span style=\\\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\\\">&nbsp;</span></span><!--[endif]--><span lang=\\\"PT-BR\\\" style=\\\"font-size:10.0pt;&#10;font-family:&quot;Verdana&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;&#10;mso-bidi-font-family:Arial;color:#292929;mso-fareast-language:EN-GB;mso-bidi-font-weight:&#10;bold\\\">Para reembolsa-lo caso seu pedido seja recusado/ n&atilde;o entregue.<o:p></o:p></span></li>\n</ul>\n<p class=\\\"MsoNormal\\\" style=\\\"margin-bottom:0in;margin-bottom:.0001pt;line-height:&#10;normal;mso-outline-level:2\\\"><span lang=\\\"PT-BR\\\" style=\\\"font-size:10.0pt;&#10;font-family:&quot;Verdana&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;&#10;mso-bidi-font-family:Arial;color:#292929;mso-fareast-language:EN-GB;mso-bidi-font-weight:&#10;bold\\\">O Portugo.pt tamb&eacute;m monitora as suas actividades no site. Esta informa&ccedil;&atilde;o &eacute; utilizada para melhorar a sua experi&ecirc;ncia, oferecendo-lhe produtos e servi&ccedil;os adaptados &agrave;s suas prefer&ecirc;ncias. (Por favor, consulte nossa </span><b><span lang=\\\"PT-BR\\\" style=\\\"font-size:10.0pt;&#10;font-family:&quot;Verdana&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;&#10;mso-bidi-font-family:Arial;color:red;mso-fareast-language:EN-GB\\\">Pol&iacute;tica de Cookies</span></b><span lang=\\\"PT-BR\\\" style=\\\"font-size:10.0pt;font-family:&quot;Verdana&quot;,&quot;sans-serif&quot;;&#10;mso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:Arial;&#10;mso-fareast-language:EN-GB\\\">)<span style=\\\"color:#292929\\\"><o:p></o:p></span></span></p>\n<p class=\\\"MsoNormal\\\" style=\\\"margin-bottom:0in;margin-bottom:.0001pt;line-height:&#10;normal\\\"><span lang=\\\"PT-BR\\\" style=\\\"font-size:10.0pt;font-family:&quot;Verdana&quot;,&quot;sans-serif&quot;;&#10;mso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:Arial;&#10;color:#292929;mso-fareast-language:EN-GB\\\">Outra maneira de nos fornecer informa&ccedil;&otilde;es &eacute; quando voc&ecirc; entrar em contato com o balc&atilde;o de atendimento ao cliente. Utilizaremos os dados recolhidos para responder &agrave;s suas perguntas ou para resolver a sua queixa. Podemos usar seu caso, completamente an&ocirc;nimo, como exemplo para uma se&ccedil;&atilde;o de FAQ.<o:p></o:p></span><br />\n<span lang=\\\"PT-BR\\\" style=\\\"font-size:10.0pt;font-family:&quot;Verdana&quot;,&quot;sans-serif&quot;;&#10;mso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:Arial;&#10;color:#292929;mso-fareast-language:EN-GB\\\">&nbsp;</span></p>\n<p class=\\\"MsoNormal\\\" style=\\\"margin-bottom:0in;margin-bottom:.0001pt;line-height:&#10;normal;mso-outline-level:2\\\"><span style=\\\"font-size: medium;\\\"><b><span lang=\\\"PT-BR\\\" style=\\\"font-family: Verdana, sans-serif;\\\">Verificando e corrigindo suas informa&ccedil;&otilde;es pessoais</span></b></span><b><span lang=\\\"PT-BR\\\" style=\\\"font-family:&quot;Verdana&quot;,&quot;sans-serif&quot;\\\"><o:p></o:p></span></b></p>\n<p class=\\\"MsoNormal\\\" style=\\\"margin-bottom:0in;margin-bottom:.0001pt;line-height:&#10;normal;mso-outline-level:2\\\"><span lang=\\\"PT-BR\\\" style=\\\"font-size:10.0pt;&#10;font-family:&quot;Verdana&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;&#10;mso-bidi-font-family:Arial;color:#292929;mso-fareast-language:EN-GB\\\">De acordo com a Lei de Prote&ccedil;&atilde;o de Dados Pessoais, voc&ecirc; tem o direito de verificar e em qualquer momento alterar todas as informa&ccedil;&otilde;es pessoais que armazenamos relacionadas ao seu perfil. Alguns artigos podem ser alterados na </span><b><span lang=\\\"PT-BR\\\" style=\\\"font-size:10.0pt;&#10;font-family:&quot;Verdana&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;&#10;mso-bidi-font-family:Arial;color:red;mso-fareast-language:EN-GB\\\">Se&ccedil;&atilde;o Minha Conta</span></b><span lang=\\\"PT-BR\\\" style=\\\"font-size:10.0pt;font-family:&quot;Verdana&quot;,&quot;sans-serif&quot;;&#10;mso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:Arial;&#10;color:#292929;mso-fareast-language:EN-GB\\\"> ou na </span><b><span lang=\\\"PT-BR\\\" style=\\\"font-size:10.0pt;font-family:&quot;Verdana&quot;,&quot;sans-serif&quot;;&#10;mso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:Arial;&#10;color:red;mso-fareast-language:EN-GB\\\">Se&ccedil;&atilde;o</span></b><span lang=\\\"PT-BR\\\" style=\\\"font-size:10.0pt;font-family:&quot;Verdana&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:&#10;&quot;Times New Roman&quot;;mso-bidi-font-family:Arial;color:#292929;mso-fareast-language:&#10;EN-GB\\\"> </span><b><span lang=\\\"PT-BR\\\" style=\\\"font-size:10.0pt;font-family:&quot;Verdana&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:&#10;&quot;Times New Roman&quot;;mso-bidi-font-family:Arial;color:red;mso-fareast-language:&#10;EN-GB\\\">Cat&aacute;logo De Endere&ccedil;os</span></b><span lang=\\\"PT-BR\\\" style=\\\"font-size:10.0pt;&#10;font-family:&quot;Verdana&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;&#10;mso-bidi-font-family:Arial;color:#292929;mso-fareast-language:EN-GB\\\">. Como alternativa, pode contactar-nos pelo e-mail &nbsp;</span><span lang=\\\"PT-BR\\\"><a href=\\\"mailto:contato@portugo.pt\\\"><b><span style=\\\"font-size:10.0pt;font-family:&quot;Verdana&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:&#10;&quot;Times New Roman&quot;;mso-bidi-font-family:Arial;mso-fareast-language:EN-GB\\\">contato@portugo.pt</span></b></a></span><span class=\\\"MsoHyperlink\\\"><b><span lang=\\\"PT-BR\\\" style=\\\"font-size:10.0pt;font-family:&quot;Verdana&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:&#10;&quot;Times New Roman&quot;;mso-bidi-font-family:Arial;mso-fareast-language:EN-GB\\\">&nbsp; </span></b></span><span lang=\\\"PT-BR\\\" style=\\\"font-size:10.0pt;font-family:&quot;Verdana&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:&#10;&quot;Times New Roman&quot;;mso-bidi-font-family:Arial;color:#292929;mso-fareast-language:&#10;EN-GB\\\">para efectuar estes procedimentos. Incentivamos voc&ecirc; a implementar todas as altera&ccedil;&otilde;es usando as op&ccedil;&otilde;es acima mencionadas, se poss&iacute;vel, j&aacute; que levar&aacute; mais tempo para a central de atendimento ao cliente processar sua consulta, caso opte por envi&aacute;-la por e-mail.<o:p></o:p></span></p>\n<p class=\\\"MsoNormal\\\" style=\\\"margin-bottom:0in;margin-bottom:.0001pt;line-height:&#10;normal\\\"><span lang=\\\"PT-BR\\\" style=\\\"font-size:10.0pt;font-family:&quot;Verdana&quot;,&quot;sans-serif&quot;;&#10;mso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:Arial;&#10;color:#292929;mso-fareast-language:EN-GB\\\">O site pode conter links para sites externos. Familiarize-se com as declara&ccedil;&otilde;es de privacidade correspondentes ao visitar esses sites. Portugo.pt seleciona cuidadosamente os sites, mas n&atilde;o podemos ser responsabilizados pela forma como estes terceiros tratam as suas informa&ccedil;&otilde;es pessoais.<o:p></o:p></span></p>\n<p class=\\\"MsoNormal\\\" style=\\\"margin-bottom:0in;margin-bottom:.0001pt;line-height:&#10;normal\\\"><span style=\\\"font-size: medium;\\\"><b><span lang=\\\"PT-BR\\\" style=\\\"font-family: Verdana, sans-serif;\\\"><br />\nPer&iacute;odo de armazenamento das informa&ccedil;&otilde;es</span></b></span><b><span lang=\\\"PT-BR\\\" style=\\\"font-family:&quot;Verdana&quot;,&quot;sans-serif&quot;\\\"><br />\n<!--[endif]--><o:p></o:p></span></b></p>\n<p class=\\\"MsoNormal\\\" style=\\\"margin-bottom:0in;margin-bottom:.0001pt;line-height:&#10;normal;mso-outline-level:2\\\"><span lang=\\\"PT-BR\\\" style=\\\"font-size:10.0pt;&#10;font-family:&quot;Verdana&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;&#10;mso-bidi-font-family:Arial;color:#292929;mso-fareast-language:EN-GB\\\">N&atilde;o manteremos seus dados por mais tempo do que o necess&aacute;rio para manter um curso normal de neg&oacute;cios e n&atilde;o iremos us&aacute;-los para outros fins que n&atilde;o os estabelecidos nas se&ccedil;&otilde;es acima.<br />\n<br />\n<o:p></o:p></span></p>\n<p class=\\\"MsoNormal\\\" style=\\\"margin-bottom:0in;margin-bottom:.0001pt;line-height:&#10;normal;mso-outline-level:2\\\"><span style=\\\"font-size: medium;\\\"><b><span lang=\\\"PT-BR\\\" style=\\\"font-family: Verdana, sans-serif;\\\">Divulga&ccedil;&atilde;o de terceiros</span></b></span><b><span lang=\\\"PT-BR\\\" style=\\\"font-family:&quot;Verdana&quot;,&quot;sans-serif&quot;\\\"><o:p></o:p></span></b></p>\n<p class=\\\"MsoNormal\\\" style=\\\"margin-bottom:0in;margin-bottom:.0001pt;line-height:&#10;normal\\\"><span lang=\\\"PT-BR\\\" style=\\\"font-size:10.0pt;font-family:&quot;Verdana&quot;,&quot;sans-serif&quot;;&#10;mso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:Arial;&#10;color:#292929;mso-fareast-language:EN-GB\\\">N&atilde;o vendemos, publicamos ou de qualquer forma divulgamos seus dados com terceiros para fins comerciais. Vamos fazer uma exce&ccedil;&atilde;o a esta declara&ccedil;&atilde;o somente no caso de um pedido de informa&ccedil;&atilde;o por uma ag&ecirc;ncia governamental, por exemplo, como parte de uma investiga&ccedil;&atilde;o policial.<o:p></o:p></span></p>\n<p class=\\\"MsoNormal\\\" style=\\\"margin-bottom:0in;margin-bottom:.0001pt;line-height:&#10;normal\\\"><b><span lang=\\\"PT-BR\\\" style=\\\"font-family:&quot;Verdana&quot;,&quot;sans-serif&quot;\\\"><span style=\\\"font-size: medium;\\\"><br />\nSeguran&ccedil;a do Website</span></span></b></p>\n<p><span lang=\\\"PT-BR\\\" style=\\\"font-size:10.0pt;line-height:107%;font-family:&quot;Verdana&quot;,&quot;sans-serif&quot;;&#10;mso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:Arial;&#10;color:#292929;mso-ansi-language:PT-BR;mso-fareast-language:EN-GB;mso-bidi-language:&#10;AR-SA\\\">Portugo.pt compromete-se a proteger os seus dados pessoais e tomar as medidas necess&aacute;rias para evitar abusos, perdas, acessos n&atilde;o autorizados, divulga&ccedil;&atilde;o acidental e altera&ccedil;&otilde;es n&atilde;o autorizadas. Se voc&ecirc; acha que seus dados n&atilde;o est&atilde;o devidamente protegidos ou se h&aacute; evid&ecirc;ncia de abuso, entre em contato com nossa central de atendimento ao cliente imediatamente atrav&eacute;s do email contato&nbsp;</span><a href=\\\"mailto:contato@portugo.pt\\\"><b><span style=\\\"font-size: 10pt;\\\">contato@portugo.pt</span></b></a><span style=\\\"font-size: 10pt; color: rgb(41, 41, 41);\\\">.</span><span style=\\\"font-size: 10pt; color: rgb(41, 41, 41);\\\"><br />\n</span></p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>', '', '1');
INSERT INTO `cms` (`cms_id`, `page_title`, `page_url`, `page_content`, `portugoese_tittle`, `portugoese_content`, `create_date_time`, `status`) VALUES
(17, 'Terms and Conditions', '', '<div><span style=\\\"font-size:10.0pt;Verdana&quot;,&quot;sans-serif&quot;;Times New Roman&quot;;&#10;color:#292929;\\\">All websites, applications and services associated with PortuGo Takeaway are to be used under the terms set in this page.</span></div>\n<div style=\\\"margin: 7.5pt 0in 0.0001pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\\\"><span style=\\\"font-size:10.0pt;Verdana&quot;,&quot;sans-serif&quot;;color:#292929;\\\">Portugo.pt is a trademark of GoTakeaway. Our headquarters are located at:</span></div>\n<div style=\\\"margin: 7.5pt 0in 0.0001pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\\\"><span style=\\\"font-size:10.0pt;Verdana&quot;,&quot;sans-serif&quot;;color:#1D2129\\\">2st Catherine\\\'s Court <br />\nSandyford, Newcastle <br />\nNE21AG <br />\nUnited Kingdom</span></div>\n<div style=\\\"margin: 7.5pt 0in 0.0001pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\\\">&nbsp;</div>\n<div><b><span style=\\\"font-size:10.0pt;Verdana&quot;,&quot;sans-serif&quot;;Times New Roman&quot;;color:red;\\\">PortuGo Takeaway is registered in the commercial register of companies of Twente Veluwe under number XXXXXXX</span></b><span style=\\\"font-size:10.0pt;Verdana&quot;,&quot;sans-serif&quot;;Times New Roman&quot;;&#10;color:#292929;\\\">.</span></div>\n<div>&nbsp;</div>\n<div style=\\\"margin-top:9.0pt;\\\"><span style=\\\"color: rgb(51, 51, 51);\\\"><span style=\\\"font-size: medium;\\\"><b>Protection of Privacy</b></span></span></div>\n<div><span style=\\\"font-size:10.0pt;Verdana&quot;,&quot;sans-serif&quot;;Times New Roman&quot;;&#10;color:#292929;\\\">Here at PortuGo the privacy of our customers is a matter of high importance. To ensure all personal information is protected in the most secure way and no data is passed onto third parties without your knowledge or permission, </span><b><span style=\\\"font-size:10.0pt;Verdana&quot;,&quot;sans-serif&quot;;Times New Roman&quot;;&#10;color:red;\\\">we enforce all rules stated in Portuguese law and EU directives concerned with protection of personal data.</span></b></div>\n<div><span style=\\\"font-size: medium;\\\">&nbsp;</span></div>\n<div><span style=\\\"font-size: medium;\\\"><b><span style=\\\"color: rgb(41, 41, 41);\\\">Personal information</span></b></span><b><span style=\\\"font-size:10.0pt;Verdana&quot;,&quot;sans-serif&quot;;Times New Roman&quot;;color:#292929;\\\"><br />\n</span></b><span style=\\\"font-size:10.0pt;Verdana&quot;,&quot;sans-serif&quot;;Times New Roman&quot;;&#10;color:#292929;\\\">As per EU and Portuguese legislation, you are granted the right to view and amend all personal information collected by us in the process of your registration or otherwise as a result of you using our website. We strongly encourage you to try and amend any personal information which can be changed through your user login by yourself. In case you have any queries regarding </span><b><span style=\\\"font-size:10.0pt;Verdana&quot;,&quot;sans-serif&quot;;Times New Roman&quot;;&#10;color:red;\\\">the way we store your information </span></b><span style=\\\"font-size:10.0pt;Verdana&quot;,&quot;sans-serif&quot;;Times New Roman&quot;;&#10;color:red;\\\">(<a name=\\\"https:__portugo.pt_page_privacy_policy\\\">Privacy statement</a>)</span><span style=\\\"font-size:10.0pt;Verdana&quot;,&quot;sans-serif&quot;;Times New Roman&quot;;&#10;color:#292929;\\\"> or if you wish to amend any information which is no longer relevant, do not hesitate to contact us at</span><a href=\\\"mailto:contato@portugo.pt\\\"><b><span style=\\\"font-size:10.0pt;Verdana&quot;,&quot;sans-serif&quot;;Times New Roman&quot;;\\\">contato@portugo.pt</span></b></a><b><span style=\\\"font-size:10.0pt;Verdana&quot;,&quot;sans-serif&quot;;Times New Roman&quot;;color:red;\\\">. </span></b></div>\n<div><b>&nbsp;</b></div>\n<div style=\\\"margin-top:9.0pt;\\\"><span style=\\\"color: rgb(51, 51, 51);\\\"><span style=\\\"font-size: medium;\\\"><b>Conditions of Sale and Delivery</b></span></span><b><br />\n<br />\n</b></div>\n<div><b><span style=\\\"font-size:10.0pt;Verdana&quot;,&quot;sans-serif&quot;;Times New Roman&quot;;color:#292929;\\\">Processing personal data</span></b></div>\n<div><span style=\\\"font-size:10.0pt;Verdana&quot;,&quot;sans-serif&quot;;Times New Roman&quot;;&#10;color:#292929;\\\">Customers &lsquo;personal information will only ever be used as detailed in this document and will be protected as per our </span><b><span style=\\\"font-size:10.0pt;Verdana&quot;,&quot;sans-serif&quot;;Times New Roman&quot;;color:red;\\\">Privacy Statement</span></b><b><span style=\\\"font-size:10.0pt;Verdana&quot;,&quot;sans-serif&quot;;Times New Roman&quot;;&#10;color:#292929;\\\">. </span></b><span style=\\\"font-size:10.0pt;Verdana&quot;,&quot;sans-serif&quot;;Times New Roman&quot;;color:#292929;\\\">We do not sell, publish or in any way share customers&rsquo; data with third parties for commercial purposes. Your address is only shared with partnering restaurants which you choose to purchase with, in order for them to deliver your order. We will make an exception to this statement only in the case of a request for information by a government agency, for example, as part of a police investigation.</span></div>\n<div>&nbsp;</div>\n<div><b><span style=\\\"font-size:10.0pt;Verdana&quot;,&quot;sans-serif&quot;;Times New Roman&quot;;color:#292929;\\\">Responsibilities of Potugo.pt and the restaurants listed on the site</span></b></div>\n<div><span style=\\\"font-size:10.0pt;Verdana&quot;,&quot;sans-serif&quot;;Times New Roman&quot;;&#10;color:#292929;\\\">Portugo.pt acts as an intermediary between you and your chosen restaurant. In the case of an order cancellation by the restaurant, we will get in touch with you as soon as possible via email. Please bear in mind that actual conditions of delivery vary and depend on the restaurant you selected. Portugo.pt&rsquo;s responsibility is restricted to:</span></div>\n<ul>\n    <li><span style=\\\"font-size:10.0pt;Verdana&quot;,&quot;sans-serif&quot;;Times New Roman&quot;;color:#292929;\\\">Ensuring your chosen restaurant delivers to your Primary address</span></li>\n    <li><span style=\\\"font-size:10.0pt;Verdana&quot;,&quot;sans-serif&quot;;Times New Roman&quot;;color:#292929;\\\">Receiving the order form you and transmitting it to your chosen restaurant whilst protecting any sensitive information. </span></li>\n</ul>\n<div>&nbsp;</div>\n<div><b><span style=\\\"font-size:10.0pt;Verdana&quot;,&quot;sans-serif&quot;;Times New Roman&quot;;color:#292929;\\\">Handling Online Payments</span></b></div>\n<div><span style=\\\"font-size:10.0pt;Verdana&quot;,&quot;sans-serif&quot;;Times New Roman&quot;;&#10;color:#292929;\\\">To ensure maximum protection of your payment details, we have chosen to partner with the global leader in online payments PayPal. Online payments made through Portugo.pt are paid into our PayPal account and later transferred to your chosen restaurant under the agreed conditions. Refunds are possible, but subject to the following restrictions: </span></div>\n<div style=\\\"text-indent:-.25in;\\\"><span style=\\\"font-size:10.0pt;color:#292929;\\\">&middot;<span style=\\\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal;Times New Roman&quot;;\\\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><span style=\\\"font-size:10.0pt;Verdana&quot;,&quot;sans-serif&quot;;Times New Roman&quot;;color:#292929;\\\">if an order delivered to you is incomplete</span></div>\n<div style=\\\"text-indent:-.25in;\\\"><span style=\\\"font-size:10.0pt;color:#292929;\\\">&middot;<span style=\\\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal;Times New Roman&quot;;\\\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><span style=\\\"font-size:10.0pt;Verdana&quot;,&quot;sans-serif&quot;;Times New Roman&quot;;color:#292929;\\\">if the restaurant for any respectable reason has cancelled you order (the exact nature of the cancellation will be disclosed to you via email) </span></div>\n<div>&nbsp;</div>\n<div><span style=\\\"font-size:10.0pt;Verdana&quot;,&quot;sans-serif&quot;;Times New Roman&quot;;&#10;color:#292929;\\\">Should such a conflict arise, you can file your complaint at </span><a href=\\\"mailto:contato@portugo.pt\\\"><b><span style=\\\"font-size:10.0pt;Verdana&quot;,&quot;sans-serif&quot;;Times New Roman&quot;;\\\">contato@portugo.pt</span></b></a></div>\n<div>&nbsp;</div>\n<div><b><span style=\\\"font-size:10.0pt;Verdana&quot;,&quot;sans-serif&quot;;Times New Roman&quot;;color:#292929;\\\">Complaint Handling and Restaurant Ratings</span></b></div>\n<div><span style=\\\"font-size:10.0pt;Verdana&quot;,&quot;sans-serif&quot;;Times New Roman&quot;;&#10;color:#292929;\\\">Any issues concerning the quality of service should be addressed to the restaurant directly. Because your experience matters to us, we monitor your feedback. Portugo.pt encourages you to use the rating and review option in case you wish to signal unsatisfactory service. In the case of consistently low performance from any given restaurant we will step in and try to resolve the issue. In case your complaint is concerned with an incomplete or cancelled order, please contact us at </span><a href=\\\"mailto:contato@portugo.pt\\\"><b><span style=\\\"font-size:10.0pt;Verdana&quot;,&quot;sans-serif&quot;;Times New Roman&quot;;\\\">contato@portugo.pt</span></b></a><span style=\\\"font-size:10.0pt;Verdana&quot;,&quot;sans-serif&quot;;Times New Roman&quot;;&#10;color:#292929;\\\">and we will arrange for your refund shortly.</span></div>\n<div>&nbsp;</div>\n<div><b><span style=\\\"font-size:10.0pt;Verdana&quot;,&quot;sans-serif&quot;;Times New Roman&quot;;color:#292929;\\\">Data Encryption</span></b></div>\n<div><span style=\\\"font-size:10.0pt;Verdana&quot;,&quot;sans-serif&quot;;Times New Roman&quot;;&#10;color:#292929;\\\">Any information you provide us in the process of registering or placing an order is protected by a firewall and is also encrypted.</span></div>\n<div>&nbsp;</div>\n<div><b><span style=\\\"font-size:10.0pt;Verdana&quot;,&quot;sans-serif&quot;;Times New Roman&quot;;color:#292929;\\\">Cookies </span></b></div>\n<div><span style=\\\"font-size:10.0pt;Verdana&quot;,&quot;sans-serif&quot;;Times New Roman&quot;;&#10;color:#292929;\\\">To improve your experience in our website, Portugo.pt uses Cookies. In a nutshell, storing cookies allows you to skip some repetitive tasks when placing your order, like filling in your postcode or keying in your username and password. Cookies are used to store the products to your shopping cart, which is a requirement to operate the website. Allowing cookies does not endanger your personal data and does not include the transmission of any additional personal information over the Internet. </span></div>\n<div>&nbsp;</div>\n<div><b><span style=\\\"font-size:10.0pt;Verdana&quot;,&quot;sans-serif&quot;;Times New Roman&quot;;color:#292929;\\\">Prices</span></b></div>\n<div><span style=\\\"font-size:10.0pt;Verdana&quot;,&quot;sans-serif&quot;;Times New Roman&quot;;color:#292929;\\\">We at Portugo.pt aim to update all prices listed at our website as they are changed. However, due to factors out of our control it is possible that there might be certain inconsistencies. Neither the restaurants nor Portugo.pt can be held liable to pay any difference between the listed and the actual price. If you notice any pricing errors please notify&nbsp;us immediately at </span><a href=\\\"mailto:contato@portugo.pt\\\"><b><span style=\\\"font-size:10.0pt;Verdana&quot;,&quot;sans-serif&quot;;Times New Roman&quot;;\\\">contato@portugo.pt</span></b></a><span style=\\\"font-size:10.0pt;Verdana&quot;,&quot;sans-serif&quot;;Times New Roman&quot;;&#10;color:#292929;\\\">and we will take action as soon as possible.</span></div>\n<div>&nbsp;</div>\n<div><b><span style=\\\"font-size:10.0pt;Verdana&quot;,&quot;sans-serif&quot;;Times New Roman&quot;;color:#292929;\\\">Intellectual property rights</span></b></div>\n<div><span style=\\\"font-size:10.0pt;Verdana&quot;,&quot;sans-serif&quot;;Times New Roman&quot;;&#10;color:#292929;\\\">Portugo.pt is a protected trademark. You may not use, copy, adapt, translate and/or distribute Portugo.pt materials without our knowledge or permission.</span></div>\n<div>&nbsp;</div>\n<div><b><span style=\\\"font-size:10.0pt;Verdana&quot;,&quot;sans-serif&quot;;Times New Roman&quot;;color:#292929;\\\">Responsibility</span></b></div>\n<div><span style=\\\"font-size:10.0pt;Verdana&quot;,&quot;sans-serif&quot;;Times New Roman&quot;;&#10;color:#292929;\\\">Portugo.pt puts customer satisfaction first. We will always aim to provide you with the best service. Portugo.pt cannot be held responsible for the malfunction of the website or any related services.</span></div>\n<div>&nbsp;</div>\n<div><span style=\\\"font-size:10.0pt;Verdana&quot;,&quot;sans-serif&quot;;Times New Roman&quot;;&#10;color:#292929;\\\"><br />\n</span><span style=\\\"color: rgb(51, 51, 51);\\\"><span style=\\\"font-family: &quot;Open Sans&quot;, sans-serif;\\\">&copy;</span></span><span style=\\\"font-size:10.0pt;Verdana&quot;,&quot;sans-serif&quot;;Times New Roman&quot;;&#10;color:#292929;\\\">Portugo.pt 2017 - All rights reserved</span></div>\n<div>&nbsp;</div>\n<p><b>&nbsp;</b>&nbsp;</p>', 'Termos e Condições', '<div><span style=\\\"font-size:10.0pt;Verdana&quot;,&quot;sans-serif&quot;;Times New Roman&quot;;&#10;color:#292929;\\\">Todos os sites, aplica&ccedil;&otilde;es e servi&ccedil;os associados ao PortuGo Takeaway devem ser utilizados nos termos estabelecidos nesta p&aacute;gina.</span></div>\n<div style=\\\"margin: 7.5pt 0in 0.0001pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\\\"><span style=\\\"font-size:10.0pt;Verdana&quot;,&quot;sans-serif&quot;;color:#292929;\\\">Portugo.pt &eacute; uma marca comercial da GoTakeaway. Nossa sede est&aacute; localizada em:</span></div>\n<div style=\\\"margin: 7.5pt 0in 0.0001pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\\\"><span style=\\\"font-size:10.0pt;Verdana&quot;,&quot;sans-serif&quot;;color:#1D2129\\\">2st Catherine\\\'s Court <br />\nSandyford, Newcastle <br />\nNE21AG <br />\nUnited Kingdom</span></div>\n<div style=\\\"margin: 7.5pt 0in 0.0001pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\\\">&nbsp;</div>\n<div><b><span style=\\\"font-size:10.0pt;Verdana&quot;,&quot;sans-serif&quot;;Times New Roman&quot;;color:red;\\\">PortuGo Takeaway est&aacute; registada no registo comercial das empresas da Twente Veluwe sob o n&uacute;mero XXXXXXX.</span></b></div>\n<div>&nbsp;</div>\n<div style=\\\"margin-top:9.0pt;\\\"><span style=\\\"color: rgb(51, 51, 51);\\\"><span style=\\\"font-size: medium;\\\"><b>Prote&ccedil;&atilde;o de Privacidade</b></span></span><br />\n&nbsp;</div>\n<div><span style=\\\"font-size:10.0pt;Verdana&quot;,&quot;sans-serif&quot;;Times New Roman&quot;;&#10;color:#292929;\\\">Aqui em PortuGo a privacidade dos nossos clientes &eacute; uma quest&atilde;o de grande import&acirc;ncia. Para garantir que todas as informa&ccedil;&otilde;es pessoais sejam protegidas da forma mais segura e nenhum dado seja transmitido a terceiros sem o seu conhecimento ou permiss&atilde;o,&nbsp;</span><span style=\\\"color: rgb(51, 51, 51);\\\"><span style=\\\"font-size: 10pt;\\\">aplicamos todas as regras estabelecidas na legisla&ccedil;&atilde;o portuguesa e nas directivas da UE relativas &agrave; protec&ccedil;&atilde;o de dados pessoais.</span></span></div>\n<div>&nbsp;</div>\n<div>&nbsp;</div>\n<div><span style=\\\"color: rgb(51, 51, 51);\\\"><span style=\\\"font-size: medium;\\\"><b>Informa&ccedil;&otilde;es Pessoais</b></span></span><span style=\\\"font-size: medium;\\\"><b><br />\n</b></span><b><span style=\\\"font-size:10.0pt;Verdana&quot;,&quot;sans-serif&quot;;Times New Roman&quot;;color:#292929;\\\"><br />\n</span></b><span style=\\\"font-size:10.0pt;Verdana&quot;,&quot;sans-serif&quot;;Times New Roman&quot;;&#10;color:#292929;\\\">De acordo com a legisla&ccedil;&atilde;o da UE e portuguesa, voc&ecirc; tem o direito de ver e alterar todas as informa&ccedil;&otilde;es pessoais coletadas por n&oacute;s no processo de seu registro ou de outra forma como resultado de seu uso em nosso site. Recomendamos vivamente que voc&ecirc; tente alterar as informa&ccedil;&otilde;es pessoais que podem ser alteradas por meio de seu login de usu&aacute;rio. <br />\nCaso tenha alguma d&uacute;vida sobre a forma como armazenamos as </span><b><span style=\\\"font-size:10.0pt;Verdana&quot;,&quot;sans-serif&quot;;Times New Roman&quot;;color:red;\\\">Suas Informa&ccedil;&otilde;es</span></b><span style=\\\"font-size:10.0pt;Verdana&quot;,&quot;sans-serif&quot;;Times New Roman&quot;;color:#292929;\\\"> (</span><span style=\\\"font-size:10.0pt;Verdana&quot;,&quot;sans-serif&quot;;Times New Roman&quot;;color:red;\\\">link para a Declara&ccedil;&atilde;o de Privacidade</span><span style=\\\"font-size:10.0pt;Verdana&quot;,&quot;sans-serif&quot;;Times New Roman&quot;;color:#292929;\\\">) ou se pretende alterar alguma informa&ccedil;&atilde;o que j&aacute; n&atilde;o seja relevante, n&atilde;o hesite em contactar-nos atrav&eacute;s do endere&ccedil;o </span><a href=\\\"mailto:contato@portugo.pt\\\"><b><span style=\\\"font-size:10.0pt;Verdana&quot;,&quot;sans-serif&quot;;Times New Roman&quot;;\\\">contato@portugo.pt</span></b></a><span style=\\\"font-size:10.0pt;Verdana&quot;,&quot;sans-serif&quot;;Times New Roman&quot;;&#10;color:#292929;\\\">. </span></div>\n<div>&nbsp;</div>\n<div style=\\\"margin-top:9.0pt;\\\"><span style=\\\"color: rgb(51, 51, 51);\\\"><span style=\\\"font-size: medium;\\\"><b>Condi&ccedil;&otilde;es de Venda e Entrega</b></span></span><b><br />\n<br />\n</b></div>\n<div><b><span style=\\\"font-size:10.0pt;Verdana&quot;,&quot;sans-serif&quot;;Times New Roman&quot;;color:#292929;\\\">Processamento de dados pessoais</span></b></div>\n<div><span style=\\\"font-size:10.0pt;Verdana&quot;,&quot;sans-serif&quot;;Times New Roman&quot;;&#10;color:#292929;\\\">As informa&ccedil;&otilde;es pessoais dos clientes s&oacute; ser&atilde;o utilizadas conforme detalhado neste documento e ser&atilde;o protegidas de acordo com nossa </span><b><span style=\\\"font-size:10.0pt;Verdana&quot;,&quot;sans-serif&quot;;Times New Roman&quot;;&#10;color:red;\\\">Declara&ccedil;&atilde;o de Privacidade</span></b><span style=\\\"font-size:10.0pt;Verdana&quot;,&quot;sans-serif&quot;;Times New Roman&quot;;&#10;color:#292929;\\\">. N&atilde;o vendemos, publicamos ou de qualquer forma compartilhamos dados de clientes com terceiros para fins comerciais. O seu endere&ccedil;o s&oacute; &eacute; partilhado com restaurantes parceiros que optar por comprar com, para que possam entregar a sua encomenda. Vamos fazer uma exce&ccedil;&atilde;o a esta declara&ccedil;&atilde;o somente no caso de um pedido de informa&ccedil;&atilde;o por uma ag&ecirc;ncia governamental, por exemplo, como parte de uma investiga&ccedil;&atilde;o policial.</span></div>\n<div>&nbsp;</div>\n<div><b><span style=\\\"font-size:10.0pt;Verdana&quot;,&quot;sans-serif&quot;;Times New Roman&quot;;color:#292929;\\\">Responsabilidades de Potugo.pt e dos restaurantes listados no site</span></b></div>\n<div><span style=\\\"font-size:10.0pt;Verdana&quot;,&quot;sans-serif&quot;;Times New Roman&quot;;&#10;color:#292929;\\\">Portugo.pt funciona como intermedi&aacute;rio entre si e o seu restaurante escolhido. No caso de um cancelamento de encomenda pelo restaurante, entraremos em contacto consigo, por em-mail, o mais r&aacute;pido poss&iacute;vel.<br />\nTenha em mente que as condi&ccedil;&otilde;es reais de entrega variam e dependem do restaurante que voc&ecirc; selecionou. A responsabilidade da Portugo.pt est&aacute; limitada a:</span></div>\n<div style=\\\"text-indent:-.25in;\\\"><span style=\\\"font-size:10.0pt;color:#292929;\\\">&middot;<span style=\\\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal;Times New Roman&quot;;\\\">&nbsp; &nbsp; &nbsp; &nbsp;</span></span><span style=\\\"font-size:10.0pt;Verdana&quot;,&quot;sans-serif&quot;;Times New Roman&quot;;color:#292929;\\\">Garantir que o restaurante escolhido entregue ao endere&ccedil;o principal.</span></div>\n<div style=\\\"text-indent:-.25in;\\\"><span style=\\\"font-size:10.0pt;color:#292929;\\\">&middot;<span style=\\\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal;Times New Roman&quot;;\\\">&nbsp; &nbsp; &nbsp; &nbsp;</span></span><span style=\\\"font-size:10.0pt;Verdana&quot;,&quot;sans-serif&quot;;Times New Roman&quot;;color:#292929;\\\">Receber o formul&aacute;rio de encomenda e transmiti-lo ao restaurante escolhido, protegendo simultaneamente qualquer informa&ccedil;&atilde;o sens&iacute;vel.</span></div>\n<div style=\\\"text-indent:-.25in;\\\"><span style=\\\"font-size:10.0pt;color:#292929;\\\">&middot;<span style=\\\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal;Times New Roman&quot;;\\\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span>&nbsp;</div>\n<div><b><span style=\\\"font-size:10.0pt;Verdana&quot;,&quot;sans-serif&quot;;Times New Roman&quot;;color:#292929;\\\">Manuseio de pagamentos Online</span></b></div>\n<div><span style=\\\"font-size:10.0pt;Verdana&quot;,&quot;sans-serif&quot;;Times New Roman&quot;;&#10;color:#292929;\\\">Para garantir a m&aacute;xima protec&ccedil;&atilde;o dos seus detalhes de pagamento, escolhemos parceria com o l&iacute;der global em pagamentos online PayPal. Os pagamentos online efectuados atrav&eacute;s do Portugo.pt s&atilde;o pagos na nossa conta PayPal e posteriormente transferidos para o seu restaurante escolhido nas condi&ccedil;&otilde;es acordadas. Os reembolsos s&atilde;o poss&iacute;veis, mas sujeitos &agrave;s seguintes restri&ccedil;&otilde;es: </span></div>\n<ul>\n    <li><span style=\\\"font-size:10.0pt;Verdana&quot;,&quot;sans-serif&quot;;Times New Roman&quot;;color:#292929;\\\">se um pedido entregue a voc&ecirc; estiver incompleto</span></li>\n    <li><span style=\\\"font-size:10.0pt;Verdana&quot;,&quot;sans-serif&quot;;Times New Roman&quot;;color:#292929;\\\">se o restaurante por qualquer raz&atilde;o razo&aacute;vel cancelou seu pedido (a natureza exata do cancelamento ser&aacute; divulgada por e-mail) </span></li>\n</ul>\n<div><span style=\\\"font-size:10.0pt;Verdana&quot;,&quot;sans-serif&quot;;Times New Roman&quot;;&#10;color:#292929;\\\">Caso surja tal conflito, pode apresentar a sua queixa em </span><a href=\\\"mailto:contato@portugo.pt\\\"><b><span style=\\\"font-size:10.0pt;Verdana&quot;,&quot;sans-serif&quot;;Times New Roman&quot;;\\\">contato@portugo.pt</span></b></a></div>\n<div>&nbsp;</div>\n<div><b><span style=\\\"font-size:10.0pt;Verdana&quot;,&quot;sans-serif&quot;;Times New Roman&quot;;color:#292929;\\\">Gerenciamento de Queixas e Avalia&ccedil;&otilde;es de Restaurantes</span></b></div>\n<div><span style=\\\"font-size:10.0pt;Verdana&quot;,&quot;sans-serif&quot;;Times New Roman&quot;;&#10;color:#292929;\\\">Quaisquer quest&otilde;es relativas &agrave; qualidade do servi&ccedil;o devem ser dirigidas ao restaurante diretamente. Sua experi&ecirc;ncia realmente importa para n&oacute;s, e por isso sempre monitoramos seu feedback. Portugo.pt encoraja-o a utilizar a op&ccedil;&atilde;o de avalia&ccedil;&atilde;o e revis&atilde;o caso deseje assinalar um servi&ccedil;o insatisfat&oacute;rio. No caso de um frequente baixo desempenho de qualquer restaurante, vamos entrar em contacto e tentar resolver o problema. Caso a sua reclama&ccedil;&atilde;o esteja relacionada com uma encomenda incompleta ou cancelada, contacte-nos atrav&eacute;s do endere&ccedil;o </span><b>contato@portugo.pt</b><span style=\\\"font-size:&#10;10.0pt;Verdana&quot;,&quot;sans-serif&quot;;Times New Roman&quot;;color:#292929;\\\"> e providenciaremos o seu reembolso em breve.</span></div>\n<div>&nbsp;</div>\n<div><b><span style=\\\"font-size:10.0pt;Verdana&quot;,&quot;sans-serif&quot;;Times New Roman&quot;;color:#292929;\\\">Criptografia de Dados</span></b></div>\n<div><span style=\\\"font-size:10.0pt;Verdana&quot;,&quot;sans-serif&quot;;Times New Roman&quot;;&#10;color:#292929;\\\">Qualquer informa&ccedil;&atilde;o que voc&ecirc; nos fornece no processo de registro ou ao realizar um pedido &eacute; protegida por um firewall e tamb&eacute;m &eacute; criptografada.</span></div>\n<div>&nbsp;</div>\n<div><b><span style=\\\"font-size:10.0pt;Verdana&quot;,&quot;sans-serif&quot;;Times New Roman&quot;;color:#292929;\\\">Cookies </span></b></div>\n<div><span style=\\\"font-size:10.0pt;Verdana&quot;,&quot;sans-serif&quot;;Times New Roman&quot;;&#10;color:#292929;\\\">Para melhorar a sua experi&ecirc;ncia no nosso site, Portugo.pt utiliza Cookies. Em poucas palavras, o armazenamento de cookies permite que voc&ecirc; salte algumas tarefas repetitivas ao fazer seu pedido, como preencher seu c&oacute;digo postal ou inserir seu nome de usu&aacute;rio e senha. Os cookies s&atilde;o usados </span><span style=\\\"font-size:10.0pt;Verdana&quot;,&quot;sans-serif&quot;;Times New Roman&quot;;color:#292929;\\\">para armazenar os produtos em seu carrinho de compras, o que </span><span style=\\\"font-size:10.0pt;Verdana&quot;,&quot;sans-serif&quot;;Times New Roman&quot;;&#10;color:#292929;\\\">&eacute;</span><span style=\\\"font-size:10.0pt;Verdana&quot;,&quot;sans-serif&quot;;Times New Roman&quot;;color:#292929;\\\"> um requisito para operar o site. O facto de permitir cookies n</span><span style=\\\"font-size:10.0pt;Verdana&quot;,&quot;sans-serif&quot;;Times New Roman&quot;;&#10;color:#292929;\\\">&atilde;</span><span style=\\\"font-size:10.0pt;Verdana&quot;,&quot;sans-serif&quot;;Times New Roman&quot;;color:#292929;\\\">o p</span><span style=\\\"font-size:10.0pt;Verdana&quot;,&quot;sans-serif&quot;;Times New Roman&quot;;&#10;color:#292929;\\\">&otilde;</span><span style=\\\"font-size:10.0pt;Verdana&quot;,&quot;sans-serif&quot;;Times New Roman&quot;;color:#292929;\\\">e em perigo os seus dados pessoais e n</span><span style=\\\"font-size:10.0pt;Verdana&quot;,&quot;sans-serif&quot;;Times New Roman&quot;;color:#292929;\\\">&atilde;</span><span style=\\\"font-size:10.0pt;Verdana&quot;,&quot;sans-serif&quot;;Times New Roman&quot;;&#10;color:#292929;\\\">o inclui a transmiss</span><span style=\\\"font-size:10.0pt;Verdana&quot;,&quot;sans-serif&quot;;Times New Roman&quot;;&#10;color:#292929;\\\">&atilde;</span><span style=\\\"font-size:10.0pt;Verdana&quot;,&quot;sans-serif&quot;;Times New Roman&quot;;color:#292929;\\\">o de quaisquer informa</span><span style=\\\"font-size:10.0pt;Verdana&quot;,&quot;sans-serif&quot;;Times New Roman&quot;;color:#292929;\\\">&ccedil;&otilde;</span><span style=\\\"font-size:10.0pt;Verdana&quot;,&quot;sans-serif&quot;;Times New Roman&quot;;&#10;color:#292929;\\\">es pessoais adicionais atrav&eacute;s da Internet. </span></div>\n<div>&nbsp;</div>\n<div><b><span style=\\\"font-size:10.0pt;Verdana&quot;,&quot;sans-serif&quot;;Times New Roman&quot;;color:#292929;\\\">Pre&ccedil;os</span></b></div>\n<div><span style=\\\"font-size:10.0pt;Verdana&quot;,&quot;sans-serif&quot;;Times New Roman&quot;;color:#292929;\\\">N&oacute;s, em Portugo.pt, pretendemos actualizar todos os pre&ccedil;os listados no nosso website &agrave; medida que s&atilde;o alterados. No entanto, devido a fatores fora de nosso controle &eacute; poss&iacute;vel que possa haver certas inconsist&ecirc;ncias. Nem os restaurantes nem Portugo.pt podem ser considerados respons&aacute;veis&nbsp;</span><span style=\\\"font-size:10.0pt;Verdana&quot;,&quot;sans-serif&quot;;Times New Roman&quot;;&#10;color:#292929;\\\">por qualquer diferen</span><span style=\\\"font-size:10.0pt;Verdana&quot;,&quot;sans-serif&quot;;Times New Roman&quot;;&#10;color:#292929;\\\">&ccedil;</span><span style=\\\"font-size:10.0pt;Verdana&quot;,&quot;sans-serif&quot;;Times New Roman&quot;;color:#292929;\\\">a entre o pre</span><span style=\\\"font-size:10.0pt;Verdana&quot;,&quot;sans-serif&quot;;Times New Roman&quot;;color:#292929;\\\">&ccedil;</span><span style=\\\"font-size:10.0pt;Verdana&quot;,&quot;sans-serif&quot;;Times New Roman&quot;;color:#292929;\\\">o listado e o pre</span><span style=\\\"font-size:10.0pt;Verdana&quot;,&quot;sans-serif&quot;;Times New Roman&quot;;color:#292929;\\\">&ccedil;</span><span style=\\\"font-size:10.0pt;Verdana&quot;,&quot;sans-serif&quot;;Times New Roman&quot;;&#10;color:#292929;\\\">o real. Se voc</span><span style=\\\"font-size:10.0pt;Verdana&quot;,&quot;sans-serif&quot;;Times New Roman&quot;;&#10;color:#292929;\\\">&ecirc;</span><span style=\\\"font-size:10.0pt;Verdana&quot;,&quot;sans-serif&quot;;Times New Roman&quot;;color:#292929;\\\"> notar qualquer erro de pre</span><span style=\\\"font-size:&#10;10.0pt;Verdana&quot;,&quot;sans-serif&quot;;Times New Roman&quot;;color:#292929;\\\">&ccedil;</span><span style=\\\"font-size:10.0pt;Verdana&quot;,&quot;sans-serif&quot;;Times New Roman&quot;;&#10;color:#292929;\\\">o, por favor nos avise imediatamente em </span><b>contato@portugo.pt</b><span style=\\\"font-size:10.0pt;Verdana&quot;,&quot;sans-serif&quot;;Times New Roman&quot;;&#10;color:#292929;\\\"> e n</span><span style=\\\"font-size:10.0pt;Verdana&quot;,&quot;sans-serif&quot;;Times New Roman&quot;;color:#292929;\\\">&oacute;</span><span style=\\\"font-size:10.0pt;Verdana&quot;,&quot;sans-serif&quot;;Times New Roman&quot;;&#10;color:#292929;\\\">s tomaremos medidas o mais r&aacute;pido poss&iacute;vel.</span></div>\n<div>&nbsp;</div>\n<div><b><span style=\\\"font-size:10.0pt;Verdana&quot;,&quot;sans-serif&quot;;Times New Roman&quot;;color:#292929;\\\">Direitos de propriedade intelectual</span></b></div>\n<div><span style=\\\"font-size:10.0pt;Verdana&quot;,&quot;sans-serif&quot;;Times New Roman&quot;;&#10;color:#292929;\\\">Portugo.pt &eacute; uma marca protegida. O utilizador n&atilde;o pode utilizar, copiar, adaptar, traduzir e / ou distribuir materiais Portugo.pt sem o nosso consentimento ou permiss&atilde;o.</span></div>\n<div>&nbsp;</div>\n<div><b><span style=\\\"font-size:10.0pt;Verdana&quot;,&quot;sans-serif&quot;;Times New Roman&quot;;color:#292929;\\\">Responsabilidade</span></b></div>\n<div><span style=\\\"font-size:10.0pt;Verdana&quot;,&quot;sans-serif&quot;;Times New Roman&quot;;&#10;color:#292929;\\\">Portugo.pt coloca a satisfa&ccedil;&atilde;o do cliente em primeiro lugar. N&oacute;s sempre teremos como objectivo fornecer-lhe o melhor servi&ccedil;o. Portugo.pt n&atilde;o pode ser responsabilizada pelo mau funcionamento do site ou de quaisquer servi&ccedil;os relacionados.</span></div>\n<div>&nbsp;</div>\n<div><span style=\\\"font-size:10.0pt;Verdana&quot;,&quot;sans-serif&quot;;Times New Roman&quot;;&#10;color:#292929;\\\"><br />\n</span></div>\n<p><span style=\\\"color: rgb(51, 51, 51);\\\"><span style=\\\"font-family: &quot;Open Sans&quot;, sans-serif;\\\">&nbsp;&copy;</span></span><span style=\\\"color: rgb(153, 153, 153); font-family: &quot;Open Sans&quot;, sans-serif;\\\">&nbsp;</span><span style=\\\"color: rgb(41, 41, 41); font-size: 10pt;\\\">Portugo.pt 2017 &ndash; Todos os direitos reservados</span>&nbsp;</p>', '', '1');
