INSERT INTO `faq` (`faq_id`, `faq_category`, `question`, `answer`, `portugoese_question`, `portugoese_answer`, `status`) VALUES
(1, 1, 'What is PortuGo?', 'PortuGo is an online food delivery platform in Portugal. Our mission is to make it easier for you to order great local food in your area.', 'O que é PortuGo?', 'PortuGo é uma plataforma online de entrega de comidas e take away. Nossa missão é oferecer a forma mais prática e rápida de pedir seus pratos preferidos nos locais mais próximos a você.', 1),
(2, 1, 'How does PortuGo work?', 'PortuGo is very straightforward to use. Simply enter your postcode on the homepage and you\\\'ll see a list of great local restaurants that deliver to you. Choose your order and enter your payment and address details. Once confirmed, your order will be prepared by the restaurant and delivered to you.', 'Como PortuGo funciona?', 'PortuGo é muito simples de usar. Basta digitar seu código postal na homepage e você terá acesso a uma lista dos melhores restaurantes ao seu redor, que entregam ou aceitem encomendas take away. Escolha seu pedido e introduza os seus detalhes de pagamento e endereço. Uma vez confirmado, o seu pedido será preparado pelo restaurante e entregue a você da forma desejada.', 1),
(3, 1, 'Where is PortuGo available?', 'PortuGo is currently available in the Lisbon area. We are ambitious to expand our service throughout Portugal in the near future.', 'PortuGo está disponível?', 'PortuGo está atualmente disponível na região de Lisboa. Temos a intenção de expandir nossos serviços em Portugal em um futuro próximo.', 1),
(4, 2, 'Is there a minimum order value?', 'The minimum order value depends on the restaurant you order from.', 'Existe um valormínimode pedido?', 'O valor mínimo de pedido é definido pelo restaurante em questão.', 1),
(5, 2, 'How do I know if my order has been confirmed?', 'Once the restaurant has accepted your order, you will receive an automated confirmation email.', 'Como saberei se meu pedido foi confirmado?', 'Uma vez que seu pedido é aceito pelo restaurante, você receberá um email automático de confirmação.', 1),
(6, 2, 'Can I order in advance?', 'Yes. When ordering, you can select the timethat you would like for the order to be delivered.', 'Posso encomendar antecipadamente?', 'Sim. Ao fazer o pedido, você pode selecionar o horário em que gostaria de receber ou retirar a sua encomenda.', 1),
(7, 2, 'What if I have a problem with my order?', 'If you have a problem with your order, we recommend that in the first instance you contact the restaurant directly using the phone number provided in your confirmation email. If this doesn\\\'t work, don\\\'t worry, we are here to help. Please contact us at contato@portugo.pt.\nIf you are not a Portuguese speaker, please contact us directly at contato@portugo.pt and we will try to assist you with the matter.', 'E se eu tiver um problema com meu pedido?', 'Se tiver um problema com seu pedido, recomendamos em primeiro lugar contactar o restaurante diretamente, através do telefone informado no email de confirmação. Se não obter sucesso, não se se preocupe, estamos aqui para ajudar. Por favor contate-nos através do email contato@portugo.pt.\nIf you are not a Portuguese speaker, please contact us directly at contato@portugo.pt and we will try to assist you with the matter.', 1),
(8, 3, 'My food is late. What should I do?', 'Please contact the restaurant directly using the details provided in your order confirmation email.', 'Meu pedido está atrasado. O que devo fazer?', 'Por favor contacte o restaurante diretamente usando os detalhes informados em seu email de confirmação.', 1),
(9, 3, 'My food did not arrive. What should I do?', 'You may be entitled to a full refund. Please contact us at contato@portugo.pt.', 'Meu pedido não chegou. O que devo fazer?', 'Você pode ter direito a um reembolso total. Por favor contacte nos através do email contato@portugo.pt.', 1),
(10, 3, 'My order has arrived incomplete. What can I do?', 'You may be entitled to a refund for the items that you have not received. Please contact us at contato@portugo.pt.', '', '', 1),
(11, 3, 'I am not satisfied with the quality of my food.', 'We are sorry to hear that. If you wish to claim a refund, please contact the restaurant as this will be subject to their own policies. We recommend that you also leave a review. We care about promoting quality, let us know about your experience by contacting us at contato@portugo.pt.', 'Não estou satisfeito com a qualidade da minha comida.', 'Lamentamos isso. Se você deseja solicitar um reembolso, entre em contato com o restaurante, pois este estará sujeito às suas próprias políticas. Recomendamos,também, que você deixe um comentário. Nos preocupamos com a qualidade de nossos restaurantes e pedimos que nos informe sobre sua experiência através do contacto@portugo.pt.', 1),
(12, 4, 'What happens to my payment if my order is declined?', 'If your order has been declined, you will receive a full refund as soon as possible.', 'O que acontece com meu pagamento se meu pedido for recusado?', 'Se seu pedido for recusado, você receberá um reembolso total o mais rápido possível.', 1),
(13, 5, 'How can I change my address or contact details?', 'When logged in, go to My Account in the top right hand corner. From here you can enter the Address Book and update your address and contact details.', 'Como posso alterar meu endereço ou detalhes de contacto?', 'Quando estiver logado, acesse Minha Conta no canto superior direito. Nessa página você pode entrar no catálogo de endereços e atualizar seus dados e outros detalhes de contacto.', 1);
