INSERT INTO `signup_content` (`signup_content_id`, `content_title`, `content_desc`, `portugoese_content_tittle`, `portugoese_content_desc`, `content_image`, `status`) VALUES
(1, 'Drive Sales', 'Still taking takeaway orders over the phone? Our service will turn around this time-consuming process. No more frustrated customers waiting on the line, or even worse, hanging up and calling the competition. We will enable you to take multiple orders at the same time. Customer satisfaction will increase and you will see your sales revenue growing.', 'Impulsionar as vendas', '<p>Ainda recebe pedidos de takeaway pelo telefone? Nosso servi&ccedil;o ir&aacute; revolucionar esse demorado processo. Sem mais clientes frustrados esperando na linha ou, pior ainda, desligando e chamando a concorr&ecirc;ncia. Nosso sistema permite receber v&aacute;rios pedidos ao mesmo tempo. Os clientes ficar&atilde;o mais satisfeitos e voc&ecirc; ver&aacute; sua receita de vendas aumentar.</p>', 'why_img11.png', 1),
(2, 'Reach More Customers', 'Attracting new customers can be a tricky business for anyone. Allow us to open up the doors of your lovely restaurant to people, who have never taken a stroll past your place. If they like what they get in their PortuGo bag, not only will they order again, but they are also bound to pay you a visit next time they feel like eating out with friends.', 'Alcance mais clientes', '<p>Atrair novos clientes pode ser complicado para qualquer um. Permita-nos abrir as portas do seu neg&oacute;cio para as pessoas que n&atilde;o conhecem seu s&iacute;tio. Se eles aprovarem seu conte&uacute;do na sacola PortuGo, n&atilde;o apenas voltar&atilde;o a fazer pedidos, como tamb&eacute;m lhe far&atilde;o uma visita na pr&oacute;xima vez que forem comer fora com os amigos.</p>', 'why_img22.png', 1),
(3, 'Increase Efficiency & Productivity', 'PortuGo Takeaway provides a fast and easy to use platform. We will enable you to focus your resources on what you do best. Our interface makes it easy to manage your orders, track your sales and analyse customer trends. You won\\\'t need to stay by the phone in case it rings anymore. Activate your account on any device and receive a notification whenever a Customer is trying to reach you.', 'Aumente a eficiência', '<p>PortuGoTakeaway oferece uma plataforma r&aacute;pida e f&aacute;cil de usar, possibilitando que voc&ecirc; concentre seus recursos no que faz melhor. Nossa interface facilita o gerenciamento de seus pedidos, rastreia suas vendas e analisa as tend&ecirc;ncias dos clientes. Voc&ecirc; n&atilde;o precisar&aacute; ficar perto do telefone esperando ele tocar. Acesse sua conta em qualquer dispositivo e receba uma notifica&ccedil;&atilde;o sempre que um cliente estiver tentando acess&aacute;-lo.</p>', 'why_img31.png', 1),
(4, 'Reduce Marketing Effort', 'With PortuGo Takeaway you will have your own homepage. We\\\'ve made it easier for you to customize your page so that it attracts customers. Upload a high-quality photo of one of your delicious meals, introduce your Restaurant in a few sentences and all of this with no extra cost to you. Customers will be able to see any current promotions and new deals you offer both on our website and our social media accounts.', 'Reduza o gasto com marketing', '<p>Com PortuGoTakeaway voc&ecirc; ter&aacute; sua pr&oacute;pria homepage. Facilitamos a personaliza&ccedil;&atilde;o da p&aacute;gina para atrair mais clientes. Fa&ccedil;a o upload da foto de uma de suas deliciosas refei&ccedil;&otilde;es, introduza o seu restaurante em poucas frases e tudo isso sem nenhum custo extra. Os clientes ser&atilde;o capazes de ver todas as suas promo&ccedil;&otilde;es atuais e novas ofertas, tanto em nosso site quanto em nossas redes sociais.</p>', 'why_img41.png', 1),
(5, 'Introduce Innovative Technology', 'The future lies with technology. That is why we have created an integrated system which allows you to manage your orders from your office, home or even while on holiday! With PortuGo, you will be able to accept or decline orders, let customers know if you are too busy for the night and alter the estimated delivery time in just one click on any device you may wish to use. Once an order is accepted, the POS device provided by us will promptly print out the receipt. Online payments will be processed by us and you will see the money clear into your account at the end of every week.', 'Introduzindo uma Tecnologia Inovadora', '<p>O futuro est&aacute; na tecnologia. &Eacute; por isso que cri&aacute;mos um sistema integrado que lhe permite gerir as suas encomendas a partir do seu escrit&oacute;rio, casa ou at&eacute; mesmo durante as f&eacute;rias! Com PortuGo, voc&ecirc; poder&aacute; aceitar ou recusar pedidos, informar aos clientes se est&aacute; ocupado demais e alterar o prazo estimado de entrega em apenas um clique, em qualquer dispositivo. Uma vez que um pedido &eacute; aceito, o dispositivo POS (fornecido por n&oacute;s)prontamente imprimir&aacute; o recibo. Pagamentos on-line ser&atilde;o processados por n&oacute;s e voc&ecirc; ver&aacute; o dinheiro em sua conta no final de cada semana.</p>', 'why_img51.png', 1);
